(335, 1, '2013-10-19 05:30:20', '2013-10-19 05:30:20', 'Glute ham raise\nBack squats: barx5, 65x5, 85x5, 95x5, 115x5, 135x3x5\nSnatch: bar, 65x2x3, 85x2, 85x2x1, 95x1, 115x2x1, 135x3x1, 155x1\nJerks: 155x3, 175x1, 185x1, 205x1, 225x1, 245x1 press out\nPlanks: 3 sets\n\n245# is the most weight I have ever had over my head. Even though the jerk was a press out that is a 20 lbs personal record. \n\nI am trying to relearn the back squat so I stay vertical and tight. As long as I keep the weight centered over my heels and don''t come forward I should be able to avoid reinjury.', 'Rehab PR:', '', 'publish', 'open', 'open', '', 'rehab-pr', '', '', '2013-10-19 05:30:20', '2013-10-19 05:30:20', '', 0, 'https://devinmcafee.wordpress.com/?p=335', 0, 'post', '', 0),
(337, 1, '2013-10-19 05:35:45', '2013-10-19 05:35:45', 'Glue ham raise: bwx12, 25x6+bwx6, 25x6+bwx6, bwx12\nSeated ohp: bar, 65x8, 85x8, 105x5, 115x5\nClose grip bench: 135x8, 155x6, 175x3, 185x3\nPull ups: bwx5x5\nCurls up to 90x4, tricep pullovers, lateral raises\nPlanks\n\nI''ve been doing mckenzie press ups at least once a day.', 'Rehab', '', 'publish', 'open', 'open', '', 'rehab', '', '', '2013-10-19 05:35:45', '2013-10-19 05:35:45', '', 0, 'https://devinmcafee.wordpress.com/?p=337', 0, 'post', '', 0),
(339, 1, '2013-10-25 15:12:39', '2013-10-25 15:12:39', '<p>GHR: BWx12, BWx12, BWx8</p><p>Backsquat: 65x5, 85x5, 95x5, 115x5, 135x5, 135x5, 135x5, 155x2, 155x2, 155x2</p><p>Rack Clean Pull: 135x3x3</p><p>Clean&amp;Jerk: 95x2+1, 95x2+1, 115x2x1+1, 135x3x1+1</p><p>Power Clean+FS+Jerk: 155x1+1+1, 155x1+2+1</p><p>Curls: 60x8, 70x8, 80x8, 80x7+1C</p><p>Lateral Raises: 20x3x8</p><p>Planks: 3 sets</p>', 'Relearning 10-24-13', '', 'publish', 'open', 'open', '', 'relearning-10-24-13', '', '', '2013-10-25 15:12:39', '2013-10-25 15:12:39', '', 0, 'http://devinmcafee.wordpress.com/?p=339', 0, 'post', '', 0),
(344, 1, '2013-11-03 19:55:42', '2013-11-03 19:55:42', '<p>GHR: BWx3x12</p><p>GHR with Empty bar: 2x10</p><p>FS: Barx5, 95x5, 115x5, 135x2x5, 155x5, 175x3, 185x2, 135x5</p><p>Jerk: 135x2, 155, 175, 185, 205, 225, 225, 245 press out, 245 press out</p><p>Push Jerk: 135x3, 155x1</p><p>Pullups: Bwx3x5, bwx3, bwx2</p><p>Pullup isometric hold at top: bwx20s, bwx20s</p><p>GHR Hold DB Rows: platex10, 35sx2x10</p>', 'Training 11/3/13', '', 'publish', 'open', 'open', '', 'training-11313', '', '', '2013-11-03 19:55:42', '2013-11-03 19:55:42', '', 0, 'http://devinmcafee.wordpress.com/?p=344', 0, 'post', '', 0),
(352, 1, '2013-11-16 20:21:25', '2013-11-16 20:21:25', 'Fs: barx5, 65x5, 95x5, 115x5, 135x2x5, 155x5, 175x2x3, 195x2\nPwr cl from knees: 95x3, 115x3, 135x3, 155x2, 175x2x1, 185x1\nPull ups: bwx5x3, bwx2x2+c\nLat pulldown: 12x10, 12x6\nPlanks: 2x100s\nLying side leg raises: 20/side\nBridges', 'Training 11/16', '', 'publish', 'open', 'open', '', 'training-1116', '', '', '2013-11-16 20:21:25', '2013-11-16 20:21:25', '', 0, 'https://devinmcafee.wordpress.com/?p=352', 0, 'post', '', 0),
(354, 1, '2013-12-01 18:44:52', '2013-12-01 18:44:52', '<p>Saturday''s Training:</p><p>Warm up: Elliptical, light stretching</p><p>GHR: BWx3x12</p><p>FS: Barx5, 65x5, 85x5, 115x5, 135x5, 155x5, 175x3, 195x2, 205x1 (post injury PR)</p><p>OHP: Barx5, 65x5, 90x5, 115x5, 135x2, 135x3x1 from rack, 90x5</p><p>Pullups: BWx5, BWx7x3</p><p>Lateral Raise: 20x8, 25x8, 30x5, 20x8</p><p>Ab Wheel: BWx5x5</p><p>Stretching and sauna</p><p> </p>', 'Training/Rehab 11/30', '', 'publish', 'open', 'open', '', 'trainingrehab-1130', '', '', '2013-12-01 18:44:52', '2013-12-01 18:44:52', '', 0, 'http://devinmcafee.wordpress.com/?p=354', 0, 'post', '', 0),
(361, 1, '2013-12-04 03:59:03', '2013-12-04 03:59:03', 'Worked up to 175# double on b.s.\nWorked up to four singles of 185# clean and jerk\nIncline bench, Pull ups, curls, weighted planks', 'Training', '', 'publish', 'open', 'open', '', 'training', '', '', '2013-12-04 03:59:03', '2013-12-04 03:59:03', '', 0, 'https://devinmcafee.wordpress.com/?p=361', 0, 'post', '', 0),
(363, 1, '2013-12-07 17:10:12', '2013-12-07 17:10:12', 'Warm-up: elliptical, bar work, hip flexor stretching\n\nFront squat: barx5, 65#x5, 85x5, 105x5, 125x5, 135x5, 155x5, 175x5\nLight ohp work\nPull ups: bwx5, 4\nLat pd: #10x2x10', 'Training', '', 'publish', 'open', 'open', '', 'training-2', '', '', '2013-12-07 17:10:12', '2013-12-07 17:10:12', '', 0, 'https://devinmcafee.wordpress.com/?p=363', 0, 'post', '', 0),
(365, 1, '2013-12-08 21:30:37', '2013-12-08 21:30:37', '<pre>Warmup: Row machine 5 mins, stretching on mat, ankle stretches<br />C&amp;J: Barx1+3, 65x1+3, 65x1+3, 85x2x1+3, 95x2x1+2, 115x1+2, 135x2x1+2, 155x1+2, 175x2x1+2, 185x1+2Curls: 60x8, 70x5, 80x5, 90x6, 70x6, 80x6, 90x2<br />GHR: BWx3x12<br />Ab Wheel: BWx2x5, BWx8<br />Finished up with band assisted hamstring stretching, mckenzie pressups, and 15 mins in the sauna<br /><br />My cleans felt good, I was moving my feet wide and wasn''t folding over in the bottom, but the jerks didn''t <br />feel very fast. I have a PT appt tomorrow to test mobility and recovery.</pre>', 'Training 12/8/2013', '', 'publish', 'open', 'open', '', 'training-1282013', '', '', '2013-12-08 21:30:37', '2013-12-08 21:30:37', '', 0, 'http://devinmcafee.wordpress.com/?p=365', 0, 'post', '', 0),
(374, 1, '2013-12-17 04:12:06', '2013-12-17 04:12:06', 'Yesterday:\n\nWorked up to 175#/185# then did some ab wheel roll outs\n\nToday:\nWarm up: 3 mins elliptical, 3 mins row, box jumps, light stretching\nFs: 135x5, 155x5, 175x5, 185x3, 205x2x2, 215x1\nClean dl: 135x3x1, 155x2x3, 175x2x1, 195x3x1\nUltra wide Pull-ups: 6x2\nSeated ohp: 95x8, 115x2x3, 95x8\nAb wheel with pause\n\nI''m feeling strong and my glutes were firing during the front squats. I felt the pressure in my glutes instead of lower back', 'Training', '', 'publish', 'open', 'open', '', 'training-3', '', '', '2013-12-17 04:12:06', '2013-12-17 04:12:06', '', 0, 'https://devinmcafee.wordpress.com/?p=374', 0, 'post', '', 0),
(376, 1, '2013-12-20 02:31:46', '2013-12-20 02:31:46', 'Front squat + jerk: 135x3+1, 155x2+1, 175x2+2, 185x2+2, 205x2+1, 205x1+1\nJerk: 225x1, 235x1 press out\nIncline bench: 155x5x5\nChin ups: bwx3x5\nLat pd chins: #10x3x8\nLateral raises: 25x2x8, 25x6\nAb wheel roll outs', 'Training', '', 'publish', 'open', 'open', '', 'training-4', '', '', '2013-12-20 02:31:46', '2013-12-20 02:31:46', '', 0, 'https://devinmcafee.wordpress.com/?p=376', 0, 'post', '', 0),
(378, 1, '2013-12-24 02:05:10', '2013-12-24 02:05:10', 'C&amp;j: 135#x3x1, 155x3x1, 175x2x1, 185x4x1, 205x1\nClean dl: 205x2, 205x1, 225x3x1\n Clean, 3 pwr jerk + pwr clean: 3 sets of 135\n\n205 is a post injury pr, as is the 225 clean dl', 'Training', '', 'publish', 'open', 'open', '', 'training-5', '', '', '2013-12-24 02:05:10', '2013-12-24 02:05:10', '', 0, 'https://devinmcafee.wordpress.com/?p=378', 0, 'post', '', 0),
(380, 1, '2013-12-28 01:26:03', '2013-12-28 01:26:03', '<p>Hang Snatch: Bar, 95x3, 115x3, 125x3, 130x2x3</p><p>Sn Pull: 4x3x135</p><p>Bk Squat: Barx5, 135x5, 145x4x5</p><p>OHP: Barx5, 95x5, 105x4x5, 115x3</p><p>RDL: 95x2x5, 115x2x5, 135x2x5</p><p>Planks, light ab wheel work, and some hamstring stretching to finish</p>', 'Cycle One, Class 3 Weightlifting Program by Bob Takano', '', 'publish', 'open', 'open', '', 'cycle-one-class-3-weightlifting-program-by-bob-takano', '', '', '2013-12-28 01:26:03', '2013-12-28 01:26:03', '', 0, 'http://devinmcafee.wordpress.com/?p=380', 0, 'post', '', 0),
(387, 1, '2013-12-29 21:36:38', '2013-12-29 21:36:38', '<pre>Warm up: 3 min elliptical, 2 minutes row machine, light stretching, calf stretching with loaded bar, bar work<br /><br />Hang Clean: 95x3, 115x3, 135x3, 155x3x3<br />Cl Pulls: 155x3, 175x3, 185x3x3<br />Rack Jerk: 135x3, 145x3, 155x3x3<br />FS: 135x5, 145x5, 155x5, 155x5, 155x5+1 Jerk<br />RDL: Bar, 95x5, 115x5, 135x2x5, 145x5<br />Pullups: BWx2x5<br /><br />The 3rd reps of the hang cleans were really tough to hold on to once I got up to 135.</pre>', 'Class III Weightlifting Program, Cycle One Week 1 Day 2', '', 'publish', 'open', 'open', '', 'class-iii-weightlifting-program-cycle-one-week-1-day-2', '', '', '2013-12-29 21:36:38', '2013-12-29 21:36:38', '', 0, 'http://devinmcafee.wordpress.com/?p=387', 0, 'post', '', 0),
(395, 1, '2013-12-31 03:13:59', '2013-12-31 03:13:59', '<pre>Warmup: Elliptical, row machine, light stretching, weighted bar ankle stretch, bar drills, drop snatches<br /><br />Snatch: 85x3, 95x3, 115x3, 135x3x3<br />Snatch Pulls: 145x3x5<br />BS: 95x5, 135x5, 145x3x5<br />Press: Barx5, 65x5, 95x5, 95x5, 95x5, 105x5<br />RDL: 95x5, 115x5, 135x3x5<br />Lateral Raise To Overhead: 15x3x8<br />Ab Wheel rollouts: BWx5x5</pre>', 'Class III Weightlifting Program, Cycle One Week 1 Day 3', '', 'publish', 'open', 'open', '', 'class-iii-weightlifting-program-cycle-one-week-1-day-3', '', '', '2013-12-31 03:13:59', '2013-12-31 03:13:59', '', 0, 'http://devinmcafee.wordpress.com/2013/12/31/class-iii-weightlifting-program-cycle-one-week-1-day-3/', 0, 'post', '', 0),
(396, 1, '2013-12-31 03:27:21', '2013-12-31 03:27:21', '', 'wpid-20131230_222254.jpg', '', 'inherit', 'open', 'open', '', 'wpid-20131230_222254-jpg', '', '', '2013-12-31 03:27:21', '2013-12-31 03:27:21', '', 397, 'http://www.devinmcafee.com/training/wp-content/uploads/2013/12/wpid-20131230_222254.jpg', 0, 'attachment', 'image/jpeg', 0),
(397, 1, '2013-12-31 03:27:23', '2013-12-31 03:27:23', '<a href="http://www.devinmcafee.com/training/wp-content/uploads/2013/12/wpid-20131230_222254.jpg"><img title="20131230_222254.jpg" class="alignnone size-full" alt="image" src="http://www.devinmcafee.com/training/wp-content/uploads/2013/12/wpid-20131230_222254.jpg" /></a>\n\n \n\n\nWhen you''re training consistently, you start to get a little more excited about food. Here is today''s post workout meal:\nBaked Grouper\nSwiss chard with bacon\nMussels sauteed in onions and garlic\nBread for dipping/putting on weight', 'Post workout meal', '', 'publish', 'open', 'open', '', 'post-workout-meal', '', '', '2013-12-31 03:27:23', '2013-12-31 03:27:23', '', 0, 'https://devinmcafee.wordpress.com/?p=397', 0, 'post', '', 0),
(399, 1, '2013-12-31 22:22:26', '2013-12-31 22:22:26', '<pre>Incline Bench: Barx5, 65x5, 95x5, 115x5, 135x5, 155x5<br />BTN Push Press: Barx5, 65x3, 95x3, 115x3, 135x2x3, 155x2<br />Explosive No Hang Standing Pullup: BWx3x3<br />Ab wheel: BWx3x5<br />Wall Assisted Handstands: 5 sets of ~10 seconds<br />Curls: 40x8, 60x5, 70x5, 80x5x4<br />Close Grip Curl: 60x5<br />Reverse Curl: 50x3x5<br />Rear Delt Cable Row: 40x3x8<br />Rope Tricep Pushdowns: 40x3x10<br />GHR: BWx2x12<br /><br /><br /></pre>', 'Assistance Exercises', '', 'publish', 'open', 'open', '', 'assistance-exercises', '', '', '2013-12-31 22:22:26', '2013-12-31 22:22:26', '', 0, 'http://devinmcafee.wordpress.com/?p=399', 0, 'post', '', 0),
(413, 1, '2014-01-03 02:33:51', '2014-01-03 02:33:51', 'C&amp;J: 115x3, 135x3, 155x2x3, 155x1+2 Jerk\nClean dl: 180x4x4\nBack squats: 95x5, 135x5, 145x2x5, 155x5\n\nSkipped rdls due to time and the fact I am fatigued from nye', 'Class III weightlifting program, cycle one, week one day four', '', 'publish', 'open', 'open', '', 'class-iii-weightlifting-program-cycle-one-week-one-day-four', '', '', '2014-01-03 02:33:51', '2014-01-03 02:33:51', '', 0, 'https://devinmcafee.wordpress.com/?p=413', 0, 'post', '', 0),
(415, 1, '2014-01-04 02:07:19', '2014-01-04 02:07:19', '<pre>Pwr Sn: 95x3, 115x3, 130x3, 140x4x3<br />Blk Sn Pull: 155x4x5<br />BS: 95x5, 115x5, 135x5, 155x4x5<br />Press: 65x5, 85x5, 105x5x5<br />RDL: 135x5, 145x5, 155x5, 155x5<br />Full DB Raises to top: 15x3x8<br />Ab Wheel: BWx3x5</pre>', 'Class III Weightlifting, Cycle One Week 2 Day 1', '', 'publish', 'open', 'open', '', 'class-iii-weightlifting-cycle-one-week-2-day-1', '', '', '2014-01-04 02:07:19', '2014-01-04 02:07:19', '', 0, 'http://devinmcafee.wordpress.com/?p=415', 0, 'post', '', 0),
(421, 1, '2014-01-05 21:42:11', '2014-01-05 21:42:11', 'Pc+pj: 95x3, 135x3,155x3, 175x4x3\nBlk Clean pull: 195x4x5\nFs: 95x5, 115x5, 135x5, 155x5, 170x4x5\nRdl: 135x5, 145x2x5, 155x5\nGhr: bwx3x8\nAb wheel: bwx3x8', 'Class III program, cycle one week two day two', '', 'publish', 'open', 'open', '', 'class-iii-program-cycle-one-week-two-day-two', '', '', '2014-01-05 21:42:11', '2014-01-05 21:42:11', '', 0, 'https://devinmcafee.wordpress.com/?p=421', 0, 'post', '', 0),
(423, 1, '2014-01-08 02:19:43', '2014-01-08 02:19:43', '<pre>Warmup: Bar work<br />Snatch: 95x3, 110x3, 130x3, 140x3, 140x3, 140x3, 140x2+F<br />Sn Pull: 155x4x5<br />BS: 95x5, 115x5, 135x5, 155x3x5<br />Press: Barx5, 65x5, 85x5, 95x5, 105x4x5<br />RDL: 105x3x5<br /><br />My hamstrings were really sore and tight from doing the GHR (properly) last time I lifted. This resulted in me not being able to hold positions and folding at the bottom of the snatches. I missed the 3rd rep of the last set because the bar came forward as I stood up out of the hole. My backsquats were pretty tough and I could see my hips were shifting at the bottom, which is no good. I decided to go light on the GHR due to my tight hamstrings and really use it as a stretch instead of as a strength exercise. I am going to try to get good sleep for a while and maybe take tomorrow off depending on how I am feeling.</pre>', 'Class III Weightlifting Program, Cycle One Week 2 Day 3', '', 'publish', 'open', 'open', '', 'class-iii-weightlifting-program-cycle-one-week-2-day-3', '', '', '2014-01-08 02:19:43', '2014-01-08 02:19:43', '', 0, 'http://devinmcafee.wordpress.com/?p=423', 0, 'post', '', 0),
(432, 1, '2014-01-10 03:16:05', '2014-01-10 03:16:05', '<pre>C&amp;J: 95x3, 115x3, 135x3, 160x3, 170x4x3<br />Cl Pulls: 195x4x5<br />FS: 135x5, 145x5, 160x5, 170x4x5<br />RDL: 135x2x5, 145x5, 155x5<br />Ab Wheel: BWx3x8<br /><br />Legs were tired today. My upper back is bugging me on my left side, I think I lost tightness on my last set of clean and jerks and allowed my shoulders to sag before the dip and drive leading to a muscle strain/whiplash. We''ll see tomorrow</pre>', 'Class III Weightlifting Program, Cycle One Week 2 Day 4', '', 'publish', 'open', 'open', '', 'class-iii-weightlifting-program-cycle-one-week-2-day-4', '', '', '2014-01-10 03:16:05', '2014-01-10 03:16:05', '', 0, 'http://devinmcafee.wordpress.com/?p=432', 0, 'post', '', 0),
(439, 1, '2014-01-11 01:08:58', '2014-01-11 01:08:58', '<pre>Bar warm up<br />Db Side Raise: 20x2x8<br />Light weight wide grip bench and incline bench<br />Low Cable Row: #10x3x8<br />Lat pulldown: #10x8, #14x5, #17x2x5, #16x5, #12x8<br />Db Row: 55x5, #85x3x5<br />Cable Flys<br />Close grip bench: 135x8<br />Rope tricep extensions: #5x3x8<br />Ez Bar curl: 70x2x8<br />Ab wheel rollouts + 1 set plank<br />Sauna + cold shower<br /><br />This was just a day to play around and stay active. I intentionally stayed away from any exercises involving my legs so I can let them recover.</pre>', 'Assistance Exercises', '', 'publish', 'open', 'open', '', 'assistance-exercises-2', '', '', '2014-01-11 01:08:58', '2014-01-11 01:08:58', '', 0, 'http://devinmcafee.wordpress.com/?p=439', 0, 'post', '', 0),
(446, 1, '2014-01-11 20:07:58', '2014-01-11 20:07:58', '<pre>I wanted to do some active recovery today just to stay loose for my workout tomorrow, I didn''t do anything strenuous, I focused on just doing some flexibility and stretching mixed with shoulder (p)rehab<br /><br />Bar: RDLs, Overhead squats, overhead press<br />Shoulder raises in all directions with 10lbs<br />Bodyweight: back extensions, single leg hip hinges<br />Foam rolling and shoulder dislocations</pre>', 'Active Recovery', '', 'publish', 'open', 'open', '', 'active-recovery', '', '', '2014-01-11 20:07:58', '2014-01-11 20:07:58', '', 0, 'http://devinmcafee.wordpress.com/?p=446', 0, 'post', '', 0),
(456, 1, '2014-01-12 23:21:29', '2014-01-12 23:21:29', '<pre>2 Pulls + Sn: 95, 115, 120, 120, 120<br />Snatch Balance: 135x2x5<br />BS: 115x5, 135x2x5<br />Press: Bar, 85x5, 95x2x5<br />RDL: 135x5, 155x2x5<br />Ab Wheel: BWx4x5</pre>', 'Class III Weightlifting Program, Cycle One Week 3 Day 1', '', 'publish', 'open', 'open', '', 'class-iii-weightlifting-program-cycle-one-week-3-day-1', '', '', '2014-01-12 23:21:29', '2014-01-12 23:21:29', '', 0, 'http://devinmcafee.wordpress.com/?p=456', 0, 'post', '', 0),
(463, 1, '2014-01-17 01:34:25', '2014-01-17 01:34:25', '<pre>Bar work<br />2 Pulls+Clean: 95, 115, 135, 145, 145, 145<br />Rack Push Jerk: 95x3, 135x3x3<br />FS: 95x5, 115x5, 135x5, 145x3x5<br />RDL: 135x5, 145x5, 155x2x5<br />Ab Wheel: BWx3x8<br />Assorted DB Raise with 10 lbs weights<br /><br />This workout and the past workout I have been feeling a little brush of sensation in my lower back when I am extending my hips in the Snatch or Clean. I''m going to focus on getting my McKenzie press ups in and back off if I feel anything suspicious in future workouts.</pre>', 'Class III Weightlifting Program, Cycle 1 Week 3 Day 2', '', 'publish', 'open', 'open', '', 'class-iii-weightlifting-program-cycle-1-week-3-day-2', '', '', '2014-01-17 01:34:25', '2014-01-17 01:34:25', '', 0, 'http://devinmcafee.wordpress.com/?p=463', 0, 'post', '', 0),
(470, 1, '2014-01-18 01:36:59', '2014-01-18 01:36:59', 'Sn: 95x3, 115x3, 120x2x3\nSn pull: 140x2x5\nBs: 95x5, 115x5, 135x5, 140x2x5\nOhp: barx5, 65x5, 85x5, 90x2x5\nRdl: 135x5, 155x5, 170x5 (pr)\nAssorted db raise and rear band raise\nWeighted plank: 45x2x60s', 'Class III weightlifting program, cycle one week three day three', '', 'publish', 'open', 'open', '', 'class-iii-weightlifting-program-cycle-one-week-three-day-three', '', '', '2014-01-18 01:36:59', '2014-01-18 01:36:59', '', 0, 'https://devinmcafee.wordpress.com/?p=470', 0, 'post', '', 0),
(472, 1, '2014-01-19 18:18:07', '2014-01-19 18:18:07', '<pre>C&amp;J: 95x3, 115x3, 135x3, 150x2x3<br />Clean Pull: 170x2x5<br />FS: 95x5, 135x5, 150x2x5<br />RDL: 150x5, 160x5</pre>', 'Class III Weightlifting Program, Cycle One Week 3 Day 4', '', 'publish', 'open', 'open', '', 'class-iii-weightlifting-program-cycle-one-week-3-day-4', '', '', '2014-01-19 18:18:07', '2014-01-19 18:18:07', '', 0, 'http://devinmcafee.wordpress.com/?p=472', 0, 'post', '', 0),
(474, 1, '2014-01-21 00:16:24', '2014-01-21 00:16:24', '<pre>Snatch: 65x3, 85x3, 95x3, 115x3, 135x3, 145x3x3<br />Sn Pull: 165x3x5<br />BS: 95x5, 115x5, 135x5, 155x5, 165x3x5<br />Press: Barx5, 65x5, 85x5, 105x5, 110x3x5<br />RDL: 135x5, 155x5, 170x2x5<br /><br />This workout was surprisingly easy and I felt both fast and strong. During my warm ups I felt really fast. I did bang my right hip flexor pretty hard during snatches and it is getting swollen. At least it''s not my pubic bone like I used to smash last summer.</pre>', 'Class III Weightlifting, Cycle One Week 4 Day 1', '', 'publish', 'open', 'open', '', 'class-iii-weightlifting-cycle-one-week-4-day-1', '', '', '2014-01-21 00:16:24', '2014-01-21 00:16:24', '', 0, 'http://devinmcafee.wordpress.com/?p=474', 0, 'post', '', 0),
(518, 1, '2014-02-25 00:31:59', '2014-02-25 00:31:59', 'Sn: 95x2, 110x2, 130x2, 140x2, 150x2, 160x2, 170x2x2 (PR Double)\r\n\r\nSn Pull: 185x3x3\r\n\r\nBS: 135x3, 135x3, 145x3, 155x3, 165x3, 175x3, 185x3x3\r\n\r\nPress: 65x3, 90x3, 105x3, 115x3, 125x3x3\r\n\r\nRDL: 135x5, 185x3, 205x3x3\r\n\r\nDB Lateral Raise: 15x10, 20x10, 25x10, 25x8\r\n\r\nAb Wheel Rollout Unassisted: BWx3x5\r\n\r\n&nbsp;\r\n\r\nI felt GREAT today. Strong, fast, and focused. I haven''t lifted since Thursday (it''s Monday today), but I did hike Old Rag mountain followed by a long night of drinking on Saturday. Also, I am starting to look a bit thicker, especially in the shoulder girdle and arms. I am unsure if this is just a result of my creatine intake or hypertrophy.', 'Class III Weightlifting Program Cycle Two, Week Four Day One', '', 'publish', 'open', 'open', '', 'class-iii-weightlifting-program-cycle-two-week-four-day-one', '', '', '2014-02-25 00:31:59', '2014-02-25 00:31:59', '', 0, 'http://www.devinmcafee.com/training/?p=518', 0, 'post', '', 0),
(477, 1, '2014-01-23 01:31:52', '2014-01-23 01:31:52', 'C&amp;J: 95x3, 115x3, 135x3, 155x3, 175x3, 180x2x3\r\n\r\nCl Pull: 205x5, 205x5, 205x4+F\r\n\r\nFS: 135x5, 145x5, 160x5, 170x5, 180x3x5\r\n\r\nRDL: 135x5, 155x5, 165x5, 175x5\r\n\r\nAssorted shoulder raise with 15 lbs db\r\n\r\nTRX Band Hold: 3x2x8s\r\n\r\nAnkles Pinned Ab Wheel Rollout: BWx3x6\r\n\r\nFelt pretty good today. The last clean pull I couldn''t get the bar past my shins though without losing form.', 'Class III Weightlifting Program, Cycle One Week 4 Day 2', '', 'publish', 'open', 'open', '', 'class-iii-weightlifting-program-cycle-one-week-4-day-2', '', '', '2014-01-23 01:37:41', '2014-01-23 01:37:41', '', 0, 'http://www.devinmcafee.com/training/?p=477', 0, 'post', '', 0),
