(481, 1, '2014-01-25 02:14:31', '2014-01-25 02:14:31', '3 Pos Sn: 95, 115, 135, 140, 150, 150x (missed from floor)\r\n\r\nSn Pull: 165x3x5\r\n\r\nBS: 95x5, 135x5, 145x5, 155x5, 165x3x5\r\n\r\nOHP: 55x5, 65x5, 85x5, 105x5, 110x3x5\r\n\r\nRDL: 135x5, 165x5, 170x2x5\r\n\r\nCurls: 70x12\r\n\r\nFor the 3 Pos snatches I went mid thigh, below knee, floor. I missed my last rep of the last set 3 Pos Sn.', 'Class III Weightlifting Program, Cycle One Week 4 Day 3', '', 'publish', 'open', 'open', '', 'class-iii-weightlifting-program-cycle-one-week-4-day-3', '', '', '2014-01-25 02:27:37', '2014-01-25 02:27:37', '', 0, 'http://www.devinmcafee.com/training/?p=481', 0, 'post', '', 0),
