(484, 1, '2014-01-25 23:04:16', '2014-01-25 23:04:16', 'Seated BTN Press: 95x5, 115x3, 95x2x8\r\n\r\nIncline Bench: 95x8, 135x8, 155x5\r\n\r\nLat Pulldown: #8x12, #11x8, #13x3x5, #8x10\r\n\r\nCurls: 70x8, 90x2x5, 90x4+F\r\n\r\nAssorted shoulder raises\r\n\r\n&nbsp;', 'Auxiliary Workout', '', 'publish', 'open', 'open', '', 'auxiliary-workout', '', '', '2014-01-25 23:04:16', '2014-01-25 23:04:16', '', 0, 'http://www.devinmcafee.com/training/?p=484', 0, 'post', '', 0),
