(486, 1, '2014-01-26 22:50:05', '2014-01-26 22:50:05', '3 Pos Clean: 95, 135, 160, 170, 180, 180\r\n\r\nCl Pulls: 205x3x5\r\n\r\nRack Split Jerk: 95x3, 135x3, 160x3, 170x3, 180x3, 180x3\r\n\r\nFront Squat: 115x5, 135x5, 160x5, 170x5, 180x3x5\r\n\r\nRDL: 135x5, 155x5, 170x5, 180x2x5\r\n\r\nAnkle Pinned Ab Wheel rollouts: BWx3x8\r\n\r\n&nbsp;\r\n\r\nCycle One is now completed. I have definitely progressed in keeping calm during the heavier sets and not getting myself worked up. I have been wearing a belt for all front squats/cleans/cl pulls over 135lbs. I will slowly bump that number up so my body can get used to holding the necessary positions without a belt.\r\n\r\n&nbsp;\r\n\r\nOn a side note: I have just finished loading creatine (my last day of the 5 day loading cycle was yesterday) so I will be taking 5g a day for the remainder of this program and I have also begun taking whey protein post workout.', 'Class III Weightlifting Program, Cycle One Week 4 Day 4', '', 'publish', 'open', 'open', '', 'class-iii-weightlifting-program-cycle-one-week-4-day-4', '', '', '2014-01-26 22:50:05', '2014-01-26 22:50:05', '', 0, 'http://www.devinmcafee.com/training/?p=486', 0, 'post', '', 0),
(487, 1, '2014-01-26 22:50:05', '2014-01-26 22:50:05', '3 Pos Clean: 95, 135, 160, 170, 180, 180\r\n\r\nCl Pulls: 205x3x5\r\n\r\nRack Split Jerk: 95x3, 135x3, 160x3, 170x3, 180x3, 180x3\r\n\r\nFront Squat: 115x5, 135x5, 160x5, 170x5, 180x3x5\r\n\r\nRDL: 135x5, 155x5, 170x5, 180x2x5\r\n\r\nAnkle Pinned Ab Wheel rollouts: BWx3x8\r\n\r\n&nbsp;\r\n\r\nCycle One is now completed. I have definitely progressed in keeping calm during the heavier sets and not getting myself worked up. I have been wearing a belt for all front squats/cleans/cl pulls over 135lbs. I will slowly bump that number up so my body can get used to holding the necessary positions without a belt.\r\n\r\n&nbsp;\r\n\r\nOn a side note: I have just finished loading creatine (my last day of the 5 day loading cycle was yesterday) so I will be taking 5g a day for the remainder of this program and I have also begun taking whey protein post workout.', 'Class III Weightlifting Program, Cycle One Week 4 Day 4', '', 'inherit', 'open', 'open', '', '486-revision-v1', '', '', '2014-01-26 22:50:05', '2014-01-26 22:50:05', '', 486, 'http://www.devinmcafee.com/training/?p=487', 0, 'revision', '', 0),
(489, 1, '2014-01-31 01:14:56', '2014-01-31 01:14:56', 'Pwr Sn: 95x2, 115x2, 125x2, 140x3x2\r\n\r\nSn Pull from Bks: 160x4x3\r\n\r\nClean + Pwr Jerk + BS + BTN Pwr Jerk: 135x2x1+1+3+1, 145x1+1+3+1, 155x1+1+3+1\r\n\r\nBS: 155x2x3\r\n\r\nRDL: 135x5, 170x3x3\r\n\r\nAb Wheel Roll Outs, Ankles Pinned with 1s Pause: BWx3x10', 'Class III Weightlifting Program, Cycle two Week 1 day 1', '', 'publish', 'open', 'open', '', 'class-iii-weightlifting-program-cycle-two-week-1-day-1', '', '', '2014-01-31 01:14:56', '2014-01-31 01:14:56', '', 0, 'http://www.devinmcafee.com/training/?p=489', 0, 'post', '', 0),
