(491, 1, '2014-02-01 01:20:46', '2014-02-01 01:20:46', 'PC + PJ: 95x2, 115x2, 135x2, 160x2, 170x3x2\r\n\r\nCl Pull: 195x3x3\r\n\r\nFS: 135x2x3, 160x3, 170x3x3\r\n\r\nRDL: 135x4, 170x3x3\r\n\r\nDB Lateral Raise: 25x3x8\r\n\r\nCurls: 70x2x10\r\n\r\nAb Wheel rollout feet against wall, 1s Pause: BWx3x5\r\n\r\n&nbsp;\r\n\r\nMy right calf is starting to give me some discomfort. It started at the end of the last cycle, and taking a few days off didn''t do much.', 'Class III Weightlifting Program, Cycle Two Week 1 Day 2', '', 'publish', 'open', 'open', '', 'class-iii-weightlifting-program-cycle-two-week-1-day-2', '', '', '2014-02-01 01:20:46', '2014-02-01 01:20:46', '', 0, 'http://www.devinmcafee.com/training/?p=491', 0, 'post', '', 0),
