(493, 1, '2014-02-02 18:06:24', '2014-02-02 18:06:24', 'Sn: 95x2, 115x2, 125x2, 140x3x2\nSn pull: 160x3x3\nBs: 115x3, 135x3, 145x3, 155x3x3\nRdl: 135x5, 165x3, 175x3x3\nDb side raise: 20x3x8\nHammer machine high row: 45lbsx12, 70x12, 95x12\nAb wheel against wall: bwx3x8\n\nCalf pain is dull now, barely felt it today. I''ve been stretching and using lacrosse ball up and down the muscle to try and help it heal. Seems to be working, along with focusing on pushing through my heels in leg movements to prevent using the muscle', 'Class III weightlifting program, cycle two week one day three', '', 'publish', 'open', 'open', '', 'class-iii-weightlifting-program-cycle-two-week-one-day-three', '', '', '2014-02-02 18:06:24', '2014-02-02 18:06:24', '', 0, 'http://www.devinmcafee.com/training/?p=493', 0, 'post', '', 0),
