(501, 1, '2014-02-09 00:52:40', '2014-02-09 00:52:40', 'Hang Clean: 115x2, 135x2, 155x2, 175x2, 185x2, 195x4x2\r\n\r\nCl Pull: 215x3, 215x3, 205x3, 205x3\r\n\r\nRack Jerk: 115x2, 135x2, 155x2, 175x2, 185x2, 195x4x2\r\n\r\nFS: 115x3, 155x3, 180x3, 195x3, 205x4x3\r\n\r\nRDL: 135x5, 165x3, 180x2x3, 185x3\r\n\r\nPlank: 35lbsx60s\r\n\r\nRussian Twist: 18lbsx19, 18lbsx14\r\n\r\nGHR Hyper: BWx2x10', 'Class III Weightlifting Cycle Two, Week Two, Day Two', '', 'inherit', 'open', 'open', '', '500-revision-v1', '', '', '2014-02-09 00:52:40', '2014-02-09 00:52:40', '', 500, 'http://www.devinmcafee.com/training/?p=501', 0, 'revision', '', 0),
(502, 1, '2014-02-09 20:04:42', '2014-02-09 20:04:42', 'Hang Snatch: 95x2, 110x2, 130x2, 140x2, 150x2, 160x4x2\r\n\r\nSn Pull: 175x4x3\r\n\r\nBS: 105x3, 125x3, 145x3, 155x3, 165x3, 175x4x3\r\n\r\nOHP: 95x3, 100x3, 95x3, 105x3, 110x3, 115x4x3\r\n\r\nRDL: 95x5, 135x3, 165x3, 180x3, 185x3, 190x3x3 (PR)\r\n\r\nAb Wheel Rollout Against Wall with Shrugged Pause: BWx3x8\r\n\r\n&nbsp;\r\n\r\nBy cocking my wrists in the snatch, it helped avoid hitting my pubic bone. I think it may help pull the bar further into my hips.\r\n\r\nOn the ab wheel rollouts I was intentionally trying to shrug up my shoulders at the fully extended position with a full second pause.', 'Class III Cycle Two, Week Two Day Three', '', 'publish', 'open', 'open', '', 'class-iii-cycle-two-week-two-day-three', '', '', '2014-02-09 20:04:42', '2014-02-09 20:04:42', '', 0, 'http://www.devinmcafee.com/training/?p=502', 0, 'post', '', 0),
(503, 1, '2014-02-09 20:04:42', '2014-02-09 20:04:42', 'Hang Snatch: 95x2, 110x2, 130x2, 140x2, 150x2, 160x4x2\r\n\r\nSn Pull: 175x4x3\r\n\r\nBS: 105x3, 125x3, 145x3, 155x3, 165x3, 175x4x3\r\n\r\nOHP: 95x3, 100x3, 95x3, 105x3, 110x3, 115x4x3\r\n\r\nRDL: 95x5, 135x3, 165x3, 180x3, 185x3, 190x3x3 (PR)\r\n\r\nAb Wheel Rollout Against Wall with Shrugged Pause: BWx3x8\r\n\r\n&nbsp;\r\n\r\nBy cocking my wrists in the snatch, it helped avoid hitting my pubic bone. I think it may help pull the bar further into my hips.\r\n\r\nOn the ab wheel rollouts I was intentionally trying to shrug up my shoulders at the fully extended position with a full second pause.', 'Class III Cycle Two, Week Two Day Three', '', 'inherit', 'open', 'open', '', '502-revision-v1', '', '', '2014-02-09 20:04:42', '2014-02-09 20:04:42', '', 502, 'http://www.devinmcafee.com/training/?p=503', 0, 'revision', '', 0),
(504, 1, '2014-02-15 18:25:19', '2014-02-15 18:25:19', '<strong>AM:</strong>\nC&amp;J: Bar, 65x2, 85x2, 95x2, 115x2, 135x2, 155x2, 175x2, 195x2, 195x1+F(clean), 155x1+2, 165x1\n\nCl Pull: 195x4x3\n\nAssorted Shoulder raises with 15, 20lbs db\n\n&nbsp;\n\nI have taken about 5 days off due to being busy, snow days, and partying. I felt out of shape today and was easily winded. I didn''t feel strong and got pinned by 195lbs. I haven''t gotten pinned in a clean in months. I think I must be getting sick.\n\n<strong>PM</strong>\nFS+ jerk: 95x2+2, 115x2+2, 135x2+2, 165x1+2, 180x 1+1, 190x2x1+1\nBS: 135x3, 145x3, 155x3, 165x3, 175x4x3\nRDL: 135x5, 165x3, 180x3, 190x3x3\nRope tri pulldowns: #4x12, #6x10, #6x8\nPull-ups: Bwx4, 3, 3, 3\nAb wheel rolls ankles pinned: bwx10, bwx3(free ankles)+5 pinned\n\nI felt that I had to finish the days workout, so I went back in and felt like a completely different man. I also drank a gallon of water between sessions mixed with emergen-C. Right lower trap/rhom was bugging me until I started lifting', 'Class III Weightlifting Program, Cycle Two Week Two Day Four', '', 'publish', 'open', 'open', '', 'class-iii-weightlifting-program-cycle-two-week-two-day-four', '', '', '2014-02-16 00:21:52', '2014-02-16 00:21:52', '', 0, 'http://www.devinmcafee.com/training/?p=504', 0, 'post', '', 0),
