(507, 1, '2014-02-16 00:21:52', '2014-02-16 00:21:52', '<strong>AM:</strong>\nC&amp;J: Bar, 65x2, 85x2, 95x2, 115x2, 135x2, 155x2, 175x2, 195x2, 195x1+F(clean), 155x1+2, 165x1\n\nCl Pull: 195x4x3\n\nAssorted Shoulder raises with 15, 20lbs db\n\n&nbsp;\n\nI have taken about 5 days off due to being busy, snow days, and partying. I felt out of shape today and was easily winded. I didn''t feel strong and got pinned by 195lbs. I haven''t gotten pinned in a clean in months. I think I must be getting sick.\n\n<strong>PM</strong>\nFS+ jerk: 95x2+2, 115x2+2, 135x2+2, 165x1+2, 180x 1+1, 190x2x1+1\nBS: 135x3, 145x3, 155x3, 165x3, 175x4x3\nRDL: 135x5, 165x3, 180x3, 190x3x3\nRope tri pulldowns: #4x12, #6x10, #6x8\nPull-ups: Bwx4, 3, 3, 3\nAb wheel rolls ankles pinned: bwx10, bwx3(free ankles)+5 pinned\n\nI felt that I had to finish the days workout, so I went back in and felt like a completely different man. I also drank a gallon of water between sessions mixed with emergen-C. Right lower trap/rhom was bugging me until I started lifting', 'Class III Weightlifting Program, Cycle Two Week Two Day Four', '', 'inherit', 'open', 'open', '', '504-revision-v1', '', '', '2014-02-16 00:21:52', '2014-02-16 00:21:52', '', 504, 'http://www.devinmcafee.com/training/?p=507', 0, 'revision', '', 0),
(509, 1, '2014-02-16 22:44:38', '2014-02-16 22:44:38', 'Sn: 95x2, 110x3, 130x3, 130x2, 130x2\r\n\r\nSn Pull: 160x2x3\r\n\r\nBS: 105x3, 125x3, 145x2x3\r\n\r\nRDL: 135x5, 165x2x3\r\n\r\nStraight Leg Roman Chair Leg Lifts: BWx18, BWx18 (Alternating with curl)\r\n\r\nPushups: BWx4x10\r\n\r\n&nbsp;', 'Class III Weightlifting Program, Cycle two Week Three Day 1', '', 'publish', 'open', 'open', '', 'class-iii-weightlifting-program-cycle-two-week-three-day-1', '', '', '2014-02-16 22:44:38', '2014-02-16 22:44:38', '', 0, 'http://www.devinmcafee.com/training/?p=509', 0, 'post', '', 0),
