(511, 1, '2014-02-18 00:53:46', '2014-02-18 00:53:46', 'C&amp;J: 95x2, 135x3, 160x3x2\r\n\r\nCl Pulls: 180x3, 180x2+1 PC\r\n\r\nFS: 110x3, 125x3, 160x2x3\r\n\r\nRDL: 160x2x3\r\n\r\nEz Bar Curls: 70x8, 80x8, 80x7+F, 80x4+F\r\n\r\nAb Wheel Rollouts against Wall: BWx3x10\r\n\r\nSauna\r\n\r\nContrast Shower\r\n\r\n&nbsp;\r\n\r\nFelt really powerful today. The 180lbs clean pulls felt easy, so I decided to throw in a Power clean at the end of my second set. The power clean was easy. I bet I could power clean 225.', 'Class III Weightlifting Cycle Cycle Two, Week Three Day Two', '', 'publish', 'open', 'open', '', 'class-iii-weightlifting-cycle-cycle-two-week-three-day-two', '', '', '2014-02-18 00:53:46', '2014-02-18 00:53:46', '', 0, 'http://www.devinmcafee.com/training/?p=511', 0, 'post', '', 0),
(512, 1, '2014-02-18 00:53:46', '2014-02-18 00:53:46', 'C&amp;J: 95x2, 135x3, 160x3x2\r\n\r\nCl Pulls: 180x3, 180x2+1 PC\r\n\r\nFS: 110x3, 125x3, 160x2x3\r\n\r\nRDL: 160x2x3\r\n\r\nEz Bar Curls: 70x8, 80x8, 80x7+F, 80x4+F\r\n\r\nAb Wheel Rollouts against Wall: BWx3x10\r\n\r\nSauna\r\n\r\nContrast Shower\r\n\r\n&nbsp;\r\n\r\nFelt really powerful today. The 180lbs clean pulls felt easy, so I decided to throw in a Power clean at the end of my second set. The power clean was easy. I bet I could power clean 225.', 'Class III Weightlifting Cycle Cycle Two, Week Three Day Two', '', 'inherit', 'open', 'open', '', '511-revision-v1', '', '', '2014-02-18 00:53:46', '2014-02-18 00:53:46', '', 511, 'http://www.devinmcafee.com/training/?p=512', 0, 'revision', '', 0),
(513, 1, '2014-02-19 00:53:13', '2014-02-19 00:53:13', '3 Pos Sn (Floor,Low,High): 115, 135, 135, 135\r\n\r\nSn Balance: 150x3, 150x3\r\n\r\nBS: 115x3, 135x3, 145x2x3\r\n\r\nRDL: 165x2x3\r\n\r\nAb Wheel Ankles Pinned: BWx3x15\r\n\r\n&nbsp;\r\n\r\nBoth calves are slightly tender, but they do not affect my lifting. I felt both fast and strong today. The backsquats in particular were very smooth feeling.', 'Class III Weightlifting Program Cycle Two, Week Three Day Three', '', 'publish', 'open', 'open', '', 'class-iii-weightlifting-program-cycle-two-week-three-day-three', '', '', '2014-02-19 00:53:13', '2014-02-19 00:53:13', '', 0, 'http://www.devinmcafee.com/training/?p=513', 0, 'post', '', 0),
(514, 1, '2014-02-19 00:53:13', '2014-02-19 00:53:13', '3 Pos Sn (Floor,Low,High): 115, 135, 135, 135\r\n\r\nSn Balance: 150x3, 150x3\r\n\r\nBS: 115x3, 135x3, 145x2x3\r\n\r\nRDL: 165x2x3\r\n\r\nAb Wheel Ankles Pinned: BWx3x15\r\n\r\n&nbsp;\r\n\r\nBoth calves are slightly tender, but they do not affect my lifting. I felt both fast and strong today. The backsquats in particular were very smooth feeling.', 'Class III Weightlifting Program Cycle Two, Week Three Day Three', '', 'inherit', 'open', 'open', '', '513-revision-v1', '', '', '2014-02-19 00:53:13', '2014-02-19 00:53:13', '', 513, 'http://www.devinmcafee.com/training/?p=514', 0, 'revision', '', 0),
(520, 1, '2014-02-27 02:16:17', '2014-02-27 02:16:17', 'C&amp;J: 115x2, 135x2, 165x2, 175x2, 185x2, 195x2, 205x2, 205x1+F (Clean) + 1\r\n\r\nCl Pull: 225x2x3, 205x3\r\n\r\nFS: 115x3, 135x3, 165x3, 175x3, 185x3, 195x3, 205x2+F+1, 205x3\r\n\r\nRDL: 135x5, 185x3, 205x3x3\r\n\r\nAb Wheel Rollouts Wall Assisted: BWx3x15\r\n\r\n&nbsp;\r\n\r\nI was ultra motivated today and would not accept defeat:\r\n\r\nFor the Clean and Jerks, I caught the second rep of the first set of 205# off center and had to ditch the bar. Pissed off, I took a step back, waited about 10 seconds, cleared my head, and reapproached the bar to make the lift.\r\n\r\nFor the front squat miss, I got halfway up but was slightly out of position and couldn''t finish the rep, so I dropped back down and recaught the bounce to make the rep.', 'Class III Weightlifting Program, Cycle Two Week Four Day Two', '', 'publish', 'open', 'open', '', 'class-iii-weightlifting-scoop-cycle-two-week-four-day-two', '', '', '2014-03-03 17:59:32', '2014-03-03 17:59:32', '', 0, 'http://www.devinmcafee.com/training/?p=520', 0, 'post', '', 0),
