(522, 1, '2014-02-27 02:16:17', '2014-02-27 02:16:17', 'C&amp;J: 115x2, 135x2, 165x2, 175x2, 185x2, 195x2, 205x2, 205x1+F (Clean) + 1\r\n\r\nCl Pull: 225x2x3, 205x3\r\n\r\nFS: 115x3, 135x3, 165x3, 175x3, 185x3, 195x3, 205x2+F+1, 205x3\r\n\r\nRDL: 135x5, 185x3, 205x3x3\r\n\r\nAb Wheel Rollouts Wall Assisted: BWx3x15\r\n\r\n&nbsp;\r\n\r\nI was ultra motivated today and would not accept defeat:\r\n\r\nFor the Clean and Jerks, I caught the second rep of the first set of 205# off center and had to ditch the bar. Pissed off, I took a step back, waited about 10 seconds, cleared my head, and reapproached the bar to make the lift.\r\n\r\nFor the front squat miss, I got halfway up but was slightly out of position and couldn''t finish the rep, so I dropped back down and recaught the bounce to make the rep.', 'Class III Weightlifting Scoop, Cycle Two Week Four Day Two', '', 'inherit', 'open', 'open', '', '520-revision-v1', '', '', '2014-02-27 02:16:17', '2014-02-27 02:16:17', '', 520, 'http://www.devinmcafee.com/training/?p=522', 0, 'revision', '', 0),
(523, 1, '2014-02-27 02:21:04', '2014-02-27 02:21:04', 'Today''s weight: 222.2 lbs\r\n\r\nToday''s calorie intake: 3650 calories by 9:30pm.\r\n\r\n<a href="http://www.devinmcafee.com/training/wp-content/uploads/2014/02/20140226_205047.jpg"><img class="alignnone size-medium wp-image-521" alt="20140226_205047" src="http://www.devinmcafee.com/training/wp-content/uploads/2014/02/20140226_205047-300x225.jpg" width="300" height="225" /></a>\r\n\r\nPost workout meal:\r\n\r\n2 Steaks, 3/4 bag of spinach sauteed with mushrooms and onions on top of a bed of rice.', 'Lean and mean', '', 'publish', 'open', 'open', '', 'lean-and-mean', '', '', '2014-02-27 02:36:48', '2014-02-27 02:36:48', '', 0, 'http://www.devinmcafee.com/training/?p=523', 0, 'post', '', 0);
