(525, 1, '2014-02-27 02:36:48', '2014-02-27 02:36:48', 'Today''s weight: 222.2 lbs\r\n\r\nToday''s calorie intake: 3650 calories by 9:30pm.\r\n\r\n<a href="http://www.devinmcafee.com/training/wp-content/uploads/2014/02/20140226_205047.jpg"><img class="alignnone size-medium wp-image-521" alt="20140226_205047" src="http://www.devinmcafee.com/training/wp-content/uploads/2014/02/20140226_205047-300x225.jpg" width="300" height="225" /></a>\r\n\r\nPost workout meal:\r\n\r\n2 Steaks, 3/4 bag of spinach sauteed with mushrooms and onions on top of a bed of rice.', 'Lean and mean', '', 'inherit', 'open', 'open', '', '523-revision-v1', '', '', '2014-02-27 02:36:48', '2014-02-27 02:36:48', '', 523, 'http://www.devinmcafee.com/training/?p=525', 0, 'revision', '', 0),
(526, 1, '2014-02-28 01:58:46', '2014-02-28 01:58:46', 'Sn: 95x2, 110x2, 130x2, 140x2, 150x2, 160x2, 170x1 + F + 1, 170x2\r\n\r\nSn Pulls: 185x3x3\r\n\r\nBS: 105x3, 125x3, 145x3, 155x3, 165x3, 175x3, 185x3x3\r\n\r\nPress: 65x3, 85x3, 95x3, 105x3, 115x3, 120x3, 125x3x3\r\n\r\nRDL: 115x4, 135x5, 185x3, 205x3, 225x2x3 (PR Triple)\r\n\r\nWall Assisted Ab Wheel Rollouts w/ 1 sec Pause: BWx3x10\r\n\r\nCurls: 60x4, 70x4, 80x4, 90x3x4\r\n\r\n&nbsp;\r\n\r\nI felt GREAT today. The snatches felt easy and I was doing a good job of not smashing my pubic bone. I did have one miss on my first set of 170# snatch, I didn''t catch the bar with my arms fully locked out and had to dump forward. I refused to fail on that set though, so I took a few seconds and re-attempted the lift to make it.\r\n\r\n&nbsp;\r\n\r\nPR on the RDL', 'Class III Weightlifting Program, Cycle Two Week Four Day Three', '', 'publish', 'open', 'open', '', 'class-iii-weightlifting-program-cycle-two-week-four-day-three', '', '', '2014-02-28 01:58:46', '2014-02-28 01:58:46', '', 0, 'http://www.devinmcafee.com/training/?p=526', 0, 'post', '', 0),
(527, 1, '2014-02-28 01:58:46', '2014-02-28 01:58:46', 'Sn: 95x2, 110x2, 130x2, 140x2, 150x2, 160x2, 170x1 + F + 1, 170x2\r\n\r\nSn Pulls: 185x3x3\r\n\r\nBS: 105x3, 125x3, 145x3, 155x3, 165x3, 175x3, 185x3x3\r\n\r\nPress: 65x3, 85x3, 95x3, 105x3, 115x3, 120x3, 125x3x3\r\n\r\nRDL: 115x4, 135x5, 185x3, 205x3, 225x2x3 (PR Triple)\r\n\r\nWall Assisted Ab Wheel Rollouts w/ 1 sec Pause: BWx3x10\r\n\r\nCurls: 60x4, 70x4, 80x4, 90x3x4\r\n\r\n&nbsp;\r\n\r\nI felt GREAT today. The snatches felt easy and I was doing a good job of not smashing my pubic bone. I did have one miss on my first set of 170# snatch, I didn''t catch the bar with my arms fully locked out and had to dump forward. I refused to fail on that set though, so I took a few seconds and re-attempted the lift to make it.\r\n\r\n&nbsp;\r\n\r\nPR on the RDL', 'Class III Weightlifting Program, Cycle Two Week Four Day Three', '', 'inherit', 'open', 'open', '', '526-revision-v1', '', '', '2014-02-28 01:58:46', '2014-02-28 01:58:46', '', 526, 'http://www.devinmcafee.com/training/?p=527', 0, 'revision', '', 0),
(528, 1, '2014-03-03 17:59:32', '2014-03-03 17:59:32', 'C&amp;J: 115x2, 135x2, 165x2, 175x2, 185x2, 195x2, 205x2, 205x1+F (Clean) + 1\r\n\r\nCl Pull: 225x2x3, 205x3\r\n\r\nFS: 115x3, 135x3, 165x3, 175x3, 185x3, 195x3, 205x2+F+1, 205x3\r\n\r\nRDL: 135x5, 185x3, 205x3x3\r\n\r\nAb Wheel Rollouts Wall Assisted: BWx3x15\r\n\r\n&nbsp;\r\n\r\nI was ultra motivated today and would not accept defeat:\r\n\r\nFor the Clean and Jerks, I caught the second rep of the first set of 205# off center and had to ditch the bar. Pissed off, I took a step back, waited about 10 seconds, cleared my head, and reapproached the bar to make the lift.\r\n\r\nFor the front squat miss, I got halfway up but was slightly out of position and couldn''t finish the rep, so I dropped back down and recaught the bounce to make the rep.', 'Class III Weightlifting Program, Cycle Two Week Four Day Two', '', 'inherit', 'open', 'open', '', '520-revision-v1', '', '', '2014-03-03 17:59:32', '2014-03-03 17:59:32', '', 520, 'http://www.devinmcafee.com/training/?p=528', 0, 'revision', '', 0),
