(777, 1, '2014-10-08 00:41:07', '2014-10-08 00:41:07', 'Power Snatch & Overhead Squat: 64x3+3; 72x2x3+3; 78x3+F, 70x3+3\nPower Clean & Power Jerk: 75x3+2; 82x3+2; 88x2x2+2\nPush Press: 46x5;	55x5; 62x4x5\nAb wheel: bwx8, bwx6', 'Dcw', '', 'publish', 'closed', 'closed', '', 'dcw-76', '', '', '2014-10-08 00:41:07', '2014-10-08 00:41:07', '', 0, 'http://www.devinmcafee.com/training/?p=777', 0, 'post', '', 0),
(757, 1, '2014-09-20 21:05:58', '2014-09-20 21:05:58', 'Pullups: BWx6x5\r\nIncline Bench: 95#x10, 135x5, 155x5, 165x3x5, 155x5\r\nConstant Tension Curls; 70x3x10\r\nRope Tricep Pulldown: #4x8, #7x3x8\r\nDB Lateral Raises: 20x2x10\r\n\r\nI believe I have a minor strain in left hip flexor. It clicks, and feels tight and sore on the front of the hip. It feels fine when doing daily activities, but a deep squat position aggravates it, especially if I have a wide stance. Also, extreme external rotation aggravates it. I am going to take a bit of time off from any sort of squat movement and ease back in once it starts feeling better.', 'Upper body Auxiliary', '', 'publish', 'closed', 'closed', '', 'upper-body-auxiliary', '', '', '2014-09-20 21:05:58', '2014-09-20 21:05:58', '', 0, 'http://www.devinmcafee.com/training/?p=757', 0, 'post', '', 0),
(758, 1, '2014-09-20 21:05:58', '2014-09-20 21:05:58', 'Pullups: BWx6x5\r\nIncline Bench: 95#x10, 135x5, 155x5, 165x3x5, 155x5\r\nConstant Tension Curls; 70x3x10\r\nRope Tricep Pulldown: #4x8, #7x3x8\r\nDB Lateral Raises: 20x2x10\r\n\r\nI believe I have a minor strain in left hip flexor. It clicks, and feels tight and sore on the front of the hip. It feels fine when doing daily activities, but a deep squat position aggravates it, especially if I have a wide stance. Also, extreme external rotation aggravates it. I am going to take a bit of time off from any sort of squat movement and ease back in once it starts feeling better.', 'Upper body Auxiliary', '', 'inherit', 'closed', 'closed', '', '757-revision-v1', '', '', '2014-09-20 21:05:58', '2014-09-20 21:05:58', '', 757, 'http://www.devinmcafee.com/training/?p=758', 0, 'revision', '', 0),
(774, 1, '2014-10-02 02:20:17', '2014-10-02 02:20:17', 'Cl ext+hng pwr cl+pwr jerk+split jerk: 50, 60, 70, 80, 85, 90, 95\nPause bs: 40x6, 60x6, 70x5, 80x3, 86x4x3\nRdl: 86x3x5\n\nFelt good doing squats again, hip feels tight but no pain. Tomorrow will tell', 'Dcw', '', 'inherit', 'closed', 'closed', '', '773-revision-v1', '', '', '2014-10-02 02:20:17', '2014-10-02 02:20:17', '', 773, 'http://www.devinmcafee.com/training/?p=774', 0, 'revision', '', 0),
(760, 1, '2014-09-23 23:37:14', '2014-09-23 23:37:14', 'Pullups: BWx6x5\r\nWide grip Pullups: BWx3\r\nOHP: Bar, 65#x5, 95x8, 115x5, 135x5, 135x3+F, 95x8, 115x5, 135x2+F\r\nCurls: 80x5x5, 100x2x2, 110x1 (PR)\r\nHammer Strength Flat Press: 70#x8, 45x15, 45x10\r\nHammer Strength Decline Press: 115x2x5\r\nWeighted Planks: 35#x3x60s\r\n\r\nLeft hip is still sore/tight. Much better, but it still bugs me in a deep squat, enough that I know better than to resume squatting right now.', 'Auxiliary Upper Body Strength Training', '', 'publish', 'closed', 'closed', '', 'auxiliary-upper-body-strength-training', '', '', '2014-09-23 23:37:14', '2014-09-23 23:37:14', '', 0, 'http://www.devinmcafee.com/training/?p=760', 0, 'post', '', 0),
