(794, 1, '2014-10-20 02:56:55', '2014-10-20 02:56:55', 'Went to a college football game yesterday and couldn''t make training with the team. Showed up at my local gym with only 50 minutes to work with. I ended up doing everything up to the heavy singles, and had to skip the back squats.\r\n\r\nSn: 95x3, 145x3, 160x2x3, 180x2\r\nClean+Jerk: 145x1+3, 170x2x1+3, 195x1+2', 'DCW (at Golds)', '', 'publish', 'closed', 'closed', '', 'dcw-at-golds-2', '', '', '2014-10-20 02:56:55', '2014-10-20 02:56:55', '', 0, 'http://www.devinmcafee.com/training/?p=794', 0, 'post', '', 0),
(783, 1, '2014-10-11 21:23:53', '2014-10-11 21:23:53', 'This is the first workout of the new cycle. Unfortunately I was coming back from vacation and couldn''t train with the team. I had to train with sticky bars that don''t spin well.\r\n\r\nSn: 65#x2, 85x2, 125, 140x2, 160x2x2,  185x2xF+1 (both infront)\r\nC&J: 150x2+1, 175x2+1, 175x(F+1+Pwr)+1, 195x2+1, 195x(1+F+Pwr)+1\r\nPause Front Squat: 145x6, 160x6, 175x6x2\r\nRDL: 145x3, 185x3x3\r\n\r\nLeft hip is feeling so much better, its a little tight at the bottom of the Front squat, but I didn''t feel it anywhere else.', 'DCW (at Gold''s)', '', 'publish', 'closed', 'closed', '', 'dcw-at-golds', '', '', '2014-10-11 21:23:53', '2014-10-11 21:23:53', '', 0, 'http://www.devinmcafee.com/training/?p=783', 0, 'post', '', 0),
