(823, 1, '2014-11-15 16:14:40', '2014-11-15 16:14:40', 'Happy to say no misses today and I went up to 95%!\r\n\r\nSn: 50, 62x2, 72x2, 82x2, 87x2, 92, 99\r\nC&J: 70x2+2, 80x2+2, 92x2+2, 97x2+2, 104, <strong>109 (PR Clean, PR Clean and jerk)</strong>\r\nPaused front squat: 70x3, 80x2, 86x6x2\r\n\r\nMy teammate gave me a great tip to try and catch the cleans high and tight and ride them down so the bar doesn''t crash on me since my biggest issue is recovering from the clean. I believe this tip is responsible for my pr.\r\n\r\n', 'Dcw', '', 'publish', 'closed', 'closed', '', 'dcw-89', '', '', '2014-11-16 18:14:16', '2014-11-16 18:14:16', '', 0, 'http://www.devinmcafee.com/training/?p=823', 0, 'post', '', 0),
