(833, 1, '2014-11-22 22:42:56', '2014-11-22 22:42:56', 'Sn: 135#, 165#, 185#, 195, 205, 225xF, 195\r\nC&J: 155, 175, 205, 215, 230, 240xF, 215\r\nBS: 175x3, 195x3, 225x3<strong>(Post injury PR set of 3)</strong>, 250x1 <strong>(POST Injury PR)</strong>, 250x1, 185x3\r\nPlanks: BWx2x120s\r\n\r\nDidn''t get much sleep last night and partied. Missed my 95% on both lifts, the snatch was behind and I didn''t catch the clean high enough so I sunk really deep in the hole and couldn''t safely recover. Happy about the ', 'DCW (at golds)', '', 'publish', 'closed', 'closed', '', 'dcw-at-golds-4', '', '', '2014-11-22 22:42:56', '2014-11-22 22:42:56', '', 0, 'http://www.devinmcafee.com/training/?p=833', 0, 'post', '', 0),
