(835, 1, '2014-11-29 15:14:28', '2014-11-29 15:14:28', 'Sn hi pull: 40x4, 55x3, 65x3, 76x2, 86x2, 92x2, 97x2, 97\nClean: 60x2, 69x2, 78x1+1FS, 87x1+1FS, 92x1+Dip pause, 98x2x1+ Dip pause\nFront squat: 75x5, 88x3, 94x3x3\n\nMissed a snatch behind last weekend and tweaked my shoulder (possibly a slight dislocation). I didn''t feel anything at the time but woke up the next morning and it was sore raising my arm. I gave it rest and iced it the first few days and then have slowly been working back into stretching it and maintaining range of motion. It has been steadily getting better and each day I have larger range of motion without discomfort. It has been a week and right now I cannot feel any discomfort and have full range of motion.', 'Dcw', '', 'publish', 'closed', 'closed', '', 'dcw-93', '', '', '2014-11-30 03:34:49', '2014-11-30 03:34:49', '', 0, 'http://www.devinmcafee.com/training/?p=835', 0, 'post', '', 0),
