(890, 1, '2015-01-17 15:33:46', '2015-01-17 15:33:46', 'Sn: 60, 74, 84, 90, 95, 100, 90, 95xF in front\nC&J: 60, 70, 80, 92, 97, 105, 110(<strong>PR</strong>), 112xF pinned, 112xpwrcl+ split jerk(<strong>PR POWER CLEAN, PR CLEAN AND JERK</strong>)\nFS: 75x2, 82x2, 92x2, 97x2, 105x2, 110, 105x2\n\nFelt really strong today. The first 112 attempt I came a little forward on the clean recovery and couldn''t get past parallel. I decided I needed to catch high with a big chest to ensure I didn''t come forward and ended up catching the clean in the power position with no need to ride it down.\n\nFront squats felt great as well', 'Dcw', '', 'publish', 'closed', 'closed', '', 'dcw-114', '', '', '2015-01-17 15:33:46', '2015-01-17 15:33:46', '', 0, 'http://www.devinmcafee.com/training/?p=890', 0, 'post', '', 0),
