            post_content_filtered, post_parent, guid, menu_order, post_type, 
            post_mime_type, comment_count)
    VALUES (519, 1, '2014-02-25 00:31:59', '2014-02-25 00:31:59', 'Sn: 95x2, 110x2, 130x2, 140x2, 150x2, 160x2, 170x2x2 (PR Double)\r\n\r\nSn Pull: 185x3x3\r\n\r\nBS: 135x3, 135x3, 145x3, 155x3, 165x3, 175x3, 185x3x3\r\n\r\nPress: 65x3, 90x3, 105x3, 115x3, 125x3x3\r\n\r\nRDL: 135x5, 185x3, 205x3x3\r\n\r\nDB Lateral Raise: 15x10, 20x10, 25x10, 25x8\r\n\r\nAb Wheel Rollout Unassisted: BWx3x5\r\n\r\n&nbsp;\r\n\r\nI felt GREAT today. Strong, fast, and focused. I haven''t lifted since Thursday (it''s Monday today), but I did hike Old Rag mountain followed by a long night of drinking on Saturday. Also, I am starting to look a bit thicker, especially in the shoulder girdle and arms. I am unsure if this is just a result of my creatine intake or hypertrophy.', 'Class III Weightlifting Program Cycle Two, Week Four Day One', '', 'inherit', 'open', 'open', '', '518-revision-v1', '', '', '2014-02-25 00:31:59', '2014-02-25 00:31:59', '', 518, 'http://www.devinmcafee.com/training/?p=519', 0, 'revision', '', 0),
(515, 1, '2014-02-21 01:44:07', '2014-02-21 01:44:07', '3 Pos Clean: 135, 160, 160, 160\r\n\r\nClean Pulls: 180x2x3\r\n\r\nRack Jerk: 135x3, 160x3x2\r\n\r\nFS: 115x3, 135x3, 160x2x3\r\n\r\nRDL: 160x2x3\r\n\r\nAb Wheel Rollout against wall w/Chest Up: BWx3x10\r\n\r\nChin up with 3 second hang + Tricep Rope Pulldowns: BWx4+#4x10, 3x(BWx3 + #5x10)\r\n\r\n&nbsp;\r\n\r\nMy right hamstring is bugging me a bit near my glute, I think I may have a minor strain from the last time I worked out.', 'Class III Weightlifting Program Cycle Two, Week Three Day Four', '', 'publish', 'open', 'open', '', 'class-iii-weightlifting-program-cycle-two-week-three-day-four', '', '', '2014-02-21 01:44:07', '2014-02-21 01:44:07', '', 0, 'http://www.devinmcafee.com/training/?p=515', 0, 'post', '', 0),
(516, 1, '2014-02-21 01:44:07', '2014-02-21 01:44:07', '3 Pos Clean: 135, 160, 160, 160\r\n\r\nClean Pulls: 180x2x3\r\n\r\nRack Jerk: 135x3, 160x3x2\r\n\r\nFS: 115x3, 135x3, 160x2x3\r\n\r\nRDL: 160x2x3\r\n\r\nAb Wheel Rollout against wall w/Chest Up: BWx3x10\r\n\r\nChin up with 3 second hang + Tricep Rope Pulldowns: BWx4+#4x10, 3x(BWx3 + #5x10)\r\n\r\n&nbsp;\r\n\r\nMy right hamstring is bugging me a bit near my glute, I think I may have a minor strain from the last time I worked out.', 'Class III Weightlifting Program Cycle Two, Week Three Day Four', '', 'inherit', 'open', 'open', '', '515-revision-v1', '', '', '2014-02-21 01:44:07', '2014-02-21 01:44:07', '', 515, 'http://www.devinmcafee.com/training/?p=516', 0, 'revision', '', 0),
(530, 1, '2014-03-05 02:05:25', '2014-03-05 02:05:25', 'C&amp;J: 115x2, 135x2, 160x2, 170x2, 180x2, 195x2, 205x1+F (Pinned)\r\n\r\nPC+SJ: 205x1, 210x1\r\n\r\nCl Pull: 225x3x3\r\n\r\nFS: 115x3, 135x3, 160x3, 180x3, 195x3, 205x3x3\r\n\r\nFS + J: 225x1 (PR)\r\n\r\nRDL: 135x5, 185x3, 205x3, 225x3x3\r\n\r\nIncline Bench: 135x3x8\r\n\r\nPlanks: BWx3x90s\r\n\r\n&nbsp;\r\n\r\nI was performing poorly in my cleans, and was chasing the bar forward on every rep.', 'Class III Weightlifting Cycle Two, Week Four Day Four', '', 'inherit', 'open', 'open', '', '529-revision-v1', '', '', '2014-03-05 02:05:25', '2014-03-05 02:05:25', '', 529, 'http://www.devinmcafee.com/training/?p=530', 0, 'revision', '', 0),
(5, 1, '2013-04-02 22:17:12', '2013-04-02 22:17:12', 'I sprained (or so I believe) my lumbar spine on February 23rd.\n\nHere I am, almost 40 days later, and I am back to training semi-regularly. I cannot stand to see myself crumble to pieces from this injury, and will do everything in my power to make a speedy return. \n\nI am currently testing the idea of high frequency front squatting. I know I can''t clean and jerk 130kg if I can''t front squat 130kg. On that note, time to up my front squat. Sore legs will plague me until my lower back is fully healed but you won''t see me crying.\n\nHere''s to a 315lbs front squat!\n\n2013: 100/85  -&gt; 2014: 130/100', '40 days and 40 nights', '', 'publish', 'open', 'open', '', '40-days-and-40-nights', '', '', '2013-04-02 22:17:12', '2013-04-02 22:17:12', '', 0, 'http://devinmcafee.wordpress.com/?p=3', 0, 'post', '', 0),
(6, 1, '2013-04-09 21:17:06', '2013-04-09 21:17:06', 'Front Squats: 135x2x3, 155x3, 175x3, 195x3, 215x3(PR Triple), 225x1, 235x1(PR single), 225x3x1\nPullups: BWx8x3\nLat Pulldown: #6x9\nDeadlifts: 135x4, 185x4, 235x4x1, 255x1, 275x2x1, 155x2\nLat Pulldown: #9x10\nCable Low Row: #9x9, #9x2x8\n\nI realized the key to a strong front squat is a tight core, and a tight upper back. I really focused on squeezing my upper back and staying upright during todays front squats. This may explain why I hit 2 new PRs. I am trying to bring my back strength back up for the snatch and to rehab my lower back injury. All in all I am happy with my training and I kept this workout to about an hour, short and sweet.\n\nI will probably lift again tomorrow but I will do either little or no squatting and focus on core stuff.', 'Training 4/9/2013', '', 'publish', 'open', 'open', '', 'training-492013', '', '', '2013-04-09 21:17:06', '2013-04-09 21:17:06', '', 0, 'http://devinmcafee.wordpress.com/?p=6', 0, 'post', '', 0),
(7, 1, '2013-04-04 20:12:55', '2013-04-04 20:12:55', '', 'WenhuaCuiDeepSquats', '', 'inherit', 'open', 'open', '', 'wenhuacuideepsquats', '', '', '2013-04-04 20:12:55', '2013-04-04 20:12:55', '', 0, 'http://www.devinmcafee.com/training/wp-content/uploads/2013/04/wenhuacuideepsquats.jpg', 0, 'attachment', 'image/jpeg', 0),
(8, 1, '2013-04-04 20:15:34', '2013-04-04 20:15:34', '<p><a href="http://www.devinmcafee.com/training/wp-content/uploads/2013/04/wenhuacuideepsquats.jpg"><img class="size-full wp-image" id="i-7" alt="Image" src="http://www.devinmcafee.com/training/wp-content/uploads/2013/04/wenhuacuideepsquats.jpg?w=454" /></a></p><p> </p><p>The past couple of weeks I have been front squatting at least 3 times a week. Today will be the start of back squatting again, this is to (hopefully) balance out my hamstring strength development. I have read that front squats deal with recovery from cleans while back squats carry over more towards the snatch recovery. Either way, I need stronger legs.</p><p>Here is to my return.</p><p>100/130 2014</p>', 'Back Squats', '', 'publish', 'open', 'open', '', 'back-squats', '', '', '2013-04-04 20:15:34', '2013-04-04 20:15:34', '', 0, 'http://devinmcafee.wordpress.com/?p=8', 0, 'post', '', 0),
(13, 1, '2013-04-06 18:21:49', '2013-04-06 18:21:49', '<p>Olympic Lifting:</p><p>Warmed up with lots of bar work, dynamic stretching, bodyweight squats, etc</p><p>Snatches: 65x3x1, 95x2, 95x1, 95x2, 115x3x1, 135x3x1, 155x3x1, 165xF, 165x3x1, 135x1, 135xF (smashed my pubic bone)</p><p>Clean and Jerk: 135x3x1, 155x3x1, 175x2x1, 185x3x1, 205xF Clean, 205xF Jerk, 205x2x1, 205xF, 205x1</p><p>Power Clean Single + FS: 135x3. 135x3. 155x3</p><p>Hanging Crunches: BWx3x8</p><p>My lifts today were 20lbs less than my maximum. I had some easy misses due to catching my cleans forward and looking down on my snatches. When I focused on alleviating those issues I started making my lifts. Next week I will get 175/215. The following week 185/225.</p><p>100/130 2014</p>', 'Training 4/6/2013', '', 'publish', 'open', 'open', '', 'training-462013', '', '', '2013-04-06 18:21:49', '2013-04-06 18:21:49', '', 0, 'http://devinmcafee.wordpress.com/?p=13', 0, 'post', '', 0),
(19, 1, '2013-04-08 19:22:17', '2013-04-08 19:22:17', '<p>Warm up with bar movements and some light stretching</p><p>BS: 135x3, 135x3, 135x2, 155x3, 175x3, 195x3, 215x2, 235x1, 255xF, 185x1, 235x1, 175x2</p><p>OHP: 95x5, 115x5, 135x3x3, 145x4x1</p><p>Push Press: 155x3x1</p><p>DB Curls: 35x5, 40x2x5</p><p>Snatch Grip Deadlift: 135x2, 135x1, 135x1, 155x2x1</p><p>Clean Deadlift: 175x2, 175x3</p><p>Stretching and mobility stuff at the end</p><p> </p><p>This is actually my first time back squatting since my injury. A workout friend noted that I was sitting too far back and was leaning over a little bit much, but I was happy with my overall performance and did not feel any discomfort in my lower back</p>', 'Training 4/8/2013', '', 'publish', 'open', 'open', '', 'training-482013', '', '', '2013-04-08 19:22:17', '2013-04-08 19:22:17', '', 0, 'http://devinmcafee.wordpress.com/?p=19', 0, 'post', '', 0),
(802, 1, '2014-10-30 02:16:26', '2014-10-30 02:16:26', 'Power clean+pwr jerk: 50x2+2, 60x2+2, 75x2+2, 80x2+2, 82x2+2, 84x2+2, 86x2+2\nElevated clean ext: 92x4x4\nFront squat: 70x4, 80x6, 86x6, 92x2x5+F, 90x6+ jerk', 'Dcw', '', 'publish', 'closed', 'closed', '', 'dcw-82', '', '', '2014-10-30 02:16:26', '2014-10-30 02:16:26', '', 0, 'http://www.devinmcafee.com/training/?p=802', 0, 'post', '', 0),
(803, 1, '2014-10-30 02:16:26', '2014-10-30 02:16:26', 'Power clean+pwr jerk: 50x2+2, 60x2+2, 75x2+2, 80x2+2, 82x2+2, 84x2+2, 86x2+2\nElevated clean ext: 92x4x4\nFront squat: 70x4, 80x6, 86x6, 92x2x5+F, 90x6+ jerk', 'Dcw', '', 'inherit', 'closed', 'closed', '', '802-revision-v1', '', '', '2014-10-30 02:16:26', '2014-10-30 02:16:26', '', 802, 'http://www.devinmcafee.com/training/?p=803', 0, 'revision', '', 0),
(40, 1, '2013-04-17 19:37:00', '2013-04-17 19:37:00', 'Warmed up with bar work, FS, bent rows, etc\n\nPullups: BWx10x3\nOHP: Barx5, 65x5, 85x5, 105x5, 125x5, 145x1, 105x5, 85x10\nIncline Bench: Barx10, 135x6, 155x5, 165x3, 165x2, 135x5\nDB Hammer Curl: 45x5, 30x10, 30x9\nLateral Raise: 20x12, 20x10\nCable Lateral Raise: #3x5, #3x5, #2x12\n\nLots of stretching my hips, lower back, hamstrings, quads, etc afterwards.\n\nWhen I was stretching, I was doing the prone stretch where my right leg is crossed infront of me and I was leaning on it with my body. I felt a sort of release of pressure in my glute and I haven''t felt any piriformis/sciatica since. It has only been about 20 minutes, but regardless this is a good sign.\n\nI can feel my back, near my SI joint on the left side. It feels agitated. I am not sure what caused it to flare up, but I am going to be taking precautions to make sure it is ok.\n\nI did a lot of reading yesterday and my symptoms of my glute pain are in line with inflammation of the sciatic nerve. Hopefully this does not indicate my lumbar sprain was actually a herniation.\n\nRegardless, nothing can keep me from training.', 'Training 4/17/2013 and Possible Woes', '', 'publish', 'open', 'open', '', 'training-4172013-and-possible-woes', '', '', '2013-04-17 19:37:00', '2013-04-17 19:37:00', '', 0, 'http://devinmcafee.wordpress.com/?p=40', 0, 'post', '', 0),
(43, 1, '2013-04-11 22:08:24', '2013-04-11 22:08:24', '<p>BS: 135x2x3, 155x3, 175x3, 195x3, 205x3, 225x2x1, 135x5</p><p>Barbell Rows: 95x8, 135x3x5, 155x2x5, 175x2x3, 135x5</p><p>Dumbell Curls: 45x3x5, 50x3x1</p><p>Lateral DB Raise: 25x2x8, 25x5</p><p>Straight Arm Lat Pulldown: #4x3x8</p><p>Close Grip Lat Pulldown: #10x8, #10x2x(5+2 Regular Grip)</p><p>Plank: BWx45s, 45x3x45s</p><p> </p><p>I felt weak today, and was tired all day beforehand. My numbers were pretty low, but I am happy about the dumbell curl numbers.</p>', 'Training 4/11/2013', '', 'publish', 'open', 'open', '', 'training-4112013', '', '', '2013-04-11 22:08:24', '2013-04-11 22:08:24', '', 0, 'http://devinmcafee.wordpress.com/?p=43', 0, 'post', '', 0),
(51, 1, '2013-04-16 02:54:51', '2013-04-16 02:54:51', '<p>My lumbar area is feeling much better, but I have an injured glute. I am not sure if the injury arose from using a lacrosse ball to massage my piriformis, or if it is from doing daily hyperextensions and glute ham raises during my first week back of lifting. The end result is tight, painful movement getting out of bed in the morning and some slight discomfort throughout the day. Snatching on Saturday left me with a burning sensation in my glute when I got deep in the hole. I cut my workout short and only ended up snatching up to 115 lbs.</p><p>My body obviously needs some sort of a break, so I have decided to take some time off from lifting until my glute stops hurting so bad. In order to keep active and get some movement in the area, I have decided to begin nightly walks. I just did a 20 minute walk to the comcast center, stretched at the top of the stairs for a while, and then walked back.</p>', 'Up The Activity', '', 'publish', 'open', 'open', '', 'up-the-activity', '', '', '2013-04-16 02:54:51', '2013-04-16 02:54:51', '', 0, 'http://devinmcafee.wordpress.com/?p=51', 0, 'post', '', 0),
(64, 1, '2013-05-10 20:44:48', '2013-05-10 20:44:48', 'Snatches: bar, 95x3x1, 115x3x1, 135x3x1, 155xF, 155x2x1, 165x3xF\nClean: 135x3x1, 155x3x1, 175x3x1, 185xF, 185x3x1, 205x3xF\nClean+FS: 185x1+2', '  Training 5/10/2013', '', 'publish', 'open', 'open', '', 'training-5102013', '', '', '2013-05-10 20:44:48', '2013-05-10 20:44:48', '', 0, 'http://devinmcafee.wordpress.com/?p=64', 0, 'post', '', 0),
(65, 1, '2013-04-18 19:40:16', '2013-04-18 19:40:16', '', '2013-04-18 15.33.26', '', 'inherit', 'open', 'open', '', '2013-04-18-15-33-26', '', '', '2013-04-18 19:40:16', '2013-04-18 19:40:16', '', 64, 'http://www.devinmcafee.com/training/wp-content/uploads/2013/04/2013-04-18-15-33-26.jpg', 0, 'attachment', 'image/jpeg', 0),
(66, 1, '2013-04-18 23:55:14', '2013-04-18 23:55:14', '', '2013-04-18 15.33.26', '', 'inherit', 'open', 'open', '', '2013-04-18-15-33-26-2', '', '', '2013-04-18 23:55:14', '2013-04-18 23:55:14', '', 0, 'http://www.devinmcafee.com/training/wp-content/uploads/2013/04/2013-04-18-15-33-261.jpg', 0, 'attachment', 'image/jpeg', 0),
(67, 1, '2013-04-18 23:57:58', '2013-04-18 23:57:58', '<p><a href="http://www.devinmcafee.com/training/wp-content/uploads/2013/04/2013-04-18-15-33-261.jpg"><img class="size-full wp-image" id="i-66" alt="Image" src="http://www.devinmcafee.com/training/wp-content/uploads/2013/04/2013-04-18-15-33-261.jpg?w=650" /></a></p><p>Despite my ongoing battle with sciatic pain, I still hit a PR double today.</p><p>FS: Barx5, 95x3, 135x3, 135x3, 155x3, 175x3, 195x3, 215x3, 225x2 (PR Double), 245xF</p><p>GHR: BWx15, 30x15, 30x10</p><p>I made my training abbreviated today as I worked out yesterday, I just wanted to test squatting. Surprisingly, no pain while front squatting. The real question is if this will cause tomorrow morning to be more or less aggravated. Either way, I''m trying to eat well and a lot in order to ensure proper recovery and rehab.</p>', 'Training 4/18/2013, PRs Regardless', '', 'publish', 'open', 'open', '', 'training-4182013-prs-regardless', '', '', '2013-04-18 23:57:58', '2013-04-18 23:57:58', '', 0, 'http://devinmcafee.wordpress.com/?p=67', 0, 'post', '', 0),
(74, 1, '2013-04-20 20:27:39', '2013-04-20 20:27:39', '<p>Almost 2 months after my lumbar sprain, I''m back.<br /><br />I warmed up with Kelly Starretts super squat hip mobility routine and a lot of bar work.</p><p>Snatch: 85x3x1, 95x3x1, 115x3x1, 135x3x1, 155x3x1, 175xF, 175x2x1, 185x1, 185xF</p><p>C&amp;J: 135x3x1, 155x3x1, 175xF, 175x2x1, 185x1, 205xF, 205xF, 205x1, 205x1, 225x1</p><p>FS: 135x3, 155x3, 175x3, 195x2x1, 195x1, 215x1</p><p> </p><p>I went 185/225, which matches my previous bests. IM BACK BABY!</p>', 'Training 4/20/2013, I''m back Baby', '', 'publish', 'open', 'open', '', 'training-4202013-im-back-baby', '', '', '2013-04-20 20:27:39', '2013-04-20 20:27:39', '', 0, 'http://devinmcafee.wordpress.com/?p=74', 0, 'post', '', 0),
(83, 1, '2013-04-22 19:01:30', '2013-04-22 19:01:30', '<p>Warming up I did Kelly Starett''s super squat mobility drill along with Tony Gentilcore''s hamstring flexibility series. I then did some bar work and light front squats (+10/20 lbs)</p><p>FS: 135x4, 155x4, 175x4, 195x3, 215x5x1, 225x3x1</p><p>OHP: 135x2, 135x1, 135x1, 155x1, 155x1</p><p>Push Press: 155x1, 155x1, 135x1, 135x1, 135x2+1 Jerk, 135x5, 155x1, 155x1+30s Hold</p><p>Pullups: BWx3x4, BWx3, BWx3x2, BWx1</p><p>DB Curls: 45x5, 50x2</p><p>Thin EZ Bar Curls: 65x2x8</p><p>I felt pretty good, although my glute was giving me some slight tingling.</p>', 'Training 4/22/2013', '', 'publish', 'open', 'open', '', 'training-4222013', '', '', '2013-04-22 19:01:30', '2013-04-22 19:01:30', '', 0, 'http://devinmcafee.wordpress.com/?p=83', 0, 'post', '', 0),
(94, 1, '2013-04-25 00:36:41', '2013-04-25 00:36:41', '<p>Warmed up with Kelly starrett super squat hip mobility drill and some bar work.</p><p><br />BS: 135x6, 135x5, 185x3, 225x3x3, 245x1, 255x1, 265x1, 225x3x1</p><p>Pullups: BWx3, BWx3, BWx2x5, BWx3, BWx4, BWx5, BWx2 (30 Total)</p><p>Push Press: 135x3x3</p><p>DB Rows: 65x2x5</p><p>Seated Lateral Raises: 25x2x8, 20x8</p><p> </p><p>The Back Squats were grinders, but I was doing a pretty good job of keeping my chest up throughout. The pullups seemed easier than usual as well.</p>', 'Training 4/24/2013', '', 'publish', 'open', 'open', '', 'training-4242013', '', '', '2013-04-25 00:36:41', '2013-04-25 00:36:41', '', 0, 'http://devinmcafee.wordpress.com/?p=94', 0, 'post', '', 0),
(100, 1, '2013-04-26 00:45:49', '2013-04-26 00:45:49', '<p>FS: 135x5, 155x5, 175x3, 195x3, 215x3, 225x2, 245x1<strong> PR</strong>, 245xF, 135x3 (Pause at bottom)</p><p>Incline Bench: 135x5, 155x5, 175x5, 195x3, 215x1, 215x1, 175x3 (Pause at bottom)</p><p>DB OHP: 50x5</p><p>DB Push Press: 55x3, 60x2, 65x1</p><p>Barebell OHP: 115x5</p><p>Even though I did heavy back squats yesterday, I still made a PR on the front squat</p>', 'Training 4/25/2013', '', 'publish', 'open', 'open', '', 'training-4252013', '', '', '2013-04-26 00:45:49', '2013-04-26 00:45:49', '', 0, 'http://devinmcafee.wordpress.com/?p=100', 0, 'post', '', 0),
(105, 1, '2013-04-27 19:18:58', '2013-04-27 19:18:58', '<p>Warmups with bar work, super squat mobility drill, hamstring stretching, glute stretching.</p><p>Snatch Pull, Hang Snatch, Overhead Squat: 115x3x1, 135x3x1</p><p>Snatch: 155xF, 155x1, 155xF</p><p>Clean and Jerk: 155x1, 155x3x1, 175x3x1, 185x2x1, 205xF, 205x1, 205xF</p><p>Deadlifts: 185x2, 205x2, 225x2, 225x2, 245x2, 265x2, 285x1, 285x1</p><p>Deadlifts (all during "Time" by Hans Zimmer): 225x8, 225x3, 225x3, 225x2</p><p>Left Handed Dumbell Curls: 35x2x8</p><p> </p><p>I felt good today, but I couldn''t push myself. Everything felt heavy and I felt uncoordinated. I believe this is from the back to back squatting I did Wednesday and Thursday. I decided to forego squatting at the end of this week''s olympic workout to get some pulls in. While I did not go super heavy, I was trying to do some volume and get my back used to deadlifting again.</p><p> </p><p>Weight update: 221lbs</p><p>(I''ve been eating pretty well recently, lots of red meat and vegetables)</p>', 'Training 4/27/2013', '', 'publish', 'open', 'open', '', 'training-4272013', '', '', '2013-04-27 19:18:58', '2013-04-27 19:18:58', '', 0, 'http://devinmcafee.wordpress.com/?p=105', 0, 'post', '', 0),
(114, 1, '2013-05-01 20:21:06', '2013-05-01 20:21:06', '<p>Warmup: Bar work, Kelly Staretts Super Squat, hamstring stretches, etcFS: 135x2x3, 155x3, 175x3, 195x3, 215x3x3 (PR)</p><p>Pull ups: BWx4x5, BWx4, BWx3, BWx2, BWx1</p><p>Push Press: 135x3, 155x3, 155x3</p><p>Clean Pull: 155x2</p><p>Hip Abductor: #7x3x8, #10x8</p><p>Hib Adductor: #8x8, #9x8, #10x8</p><p>Lateral Raises: 30x5, 25x2x8</p><p>Cool down: Stretching hips, hamstrings, quads, etc</p><p> </p><p>I have been sick for the past 3 days and this is my first day back to training. I didn''t feel too good but I got a PR in the FS anyways.</p>', 'Training 5/1/2013', '', 'publish', 'open', 'open', '', 'training-512013', '', '', '2013-05-01 20:21:06', '2013-05-01 20:21:06', '', 0, 'http://devinmcafee.wordpress.com/?p=114', 0, 'post', '', 0),
(120, 1, '2013-05-04 20:33:36', '2013-05-04 20:33:36', '<p>Warmed up with hamstring stretching, super squat mobility drill, bar work etc</p><p>Snatches: Bar, 65x5x1, 85x5x1, 105x3x1, 115x3x1, 135x3x1, 155xF, 155x3x1, 165x3x1, 175x3xF, 135xF</p><p>C&amp;J: 135x3x1, 155x1, 175x1, 185x1, 205x1, 225x3xF</p><p>Clean, Jerk, Back Squat, BTN Jerk: 185x1,1,1,F, 185x3x1,1,1,1</p><p> </p><p>I didn''t get great rest last night (I was up until about 3am) and I didn''t eat a whole lot. Also, it has been about 3 or 4 days since my last workout. I felt kind of tight, and was getting slumped over in the hole. I took a while to get warmed up but my right knee kept popping when I would get into the start position. I was wearing underarmour breathable shorts which may have kept my knee cool and never let it warm up. I felt some slight tenderness in my knees as the workout progressed and also in my calves. Due to these distractions and the lack of sleep, I believe I had a subpar workout.</p>', 'Training 5/4/2013', '', 'publish', 'open', 'open', '', 'training-542013', '', '', '2013-05-04 20:33:36', '2013-05-04 20:33:36', '', 0, 'http://devinmcafee.wordpress.com/?p=120', 0, 'post', '', 0),
(129, 1, '2013-05-06 19:31:39', '2013-05-06 19:31:39', '<p>FS: 135x2x3, 155x3, 175x3, 195x3, 205x3, 225x2, 225x1, 245xF, 205x1, 225xF, 135x1</p><p>Push Press: 135x3, 155x2, 165x2, 135x2</p><p>OHP: 135x2, 135x2</p><p>Hip Adductor: #150x3x8</p><p>Hip Abductor #130x2x8, #110x12</p><p>DB Curls: 40x3x5, 50x1, 25x8</p><p>Lat Pulldown to Sternum: #8x3x12</p><p>Front Squat Hold: 315x20, 315x20</p><p>Back Squat Hold: 315x24, 315x30</p><p> </p><p>Not the best day, but I put some decent work in.</p>', 'Training 5/6/2013', '', 'publish', 'open', 'open', '', 'training-562013', '', '', '2013-05-06 19:31:39', '2013-05-06 19:31:39', '', 0, 'http://devinmcafee.wordpress.com/?p=129', 0, 'post', '', 0),
(135, 1, '2013-05-08 22:39:59', '2013-05-08 22:39:59', '<p>The squat rack was "out of order", so in order to squat I would stand up with the weight from the bench (bar was on highest setting), walk with the bar on my back to an open space, do my set, then BTN push press the weight infront of me to put back.</p><p> </p><p>BS: 115x5, 135x5, 155x5, 155x5, 155x5</p><p>Clean Deadlift: 155x2, 185x2, 185x2, 235x1, 235x2, 235x2, 285x3x1, 305xF (Grip), 305x4x1, 235x3x2, 135x1</p><p>Tricep Pullovers: Barx5, 45x5 (Pain getting up from laying position hindered more sets)</p><p>Standing Tricep Pullovers: 45x5, 55x5, 55x5</p><p>Rope Pulldowns: #8x8, #10x8</p><p>Single Arm Cable Pulldown: #4x8, #4x8</p><p>Cable Lateral Raises: #3x8, #4x5, #3x2x8</p><p>Hip Adductor: #4x8, #8x8, #10x8, #8x8</p><p>Hip Abductor: #10x8, #12x8, #14x5, #16x1, #18x1, #20x5x1</p><p>Cooled down with Hamstring stretching, bridges, calf stretching, etc</p>', 'Training 5/8/2013', '', 'publish', 'open', 'open', '', 'training-582013', '', '', '2013-05-08 22:39:59', '2013-05-08 22:39:59', '', 0, 'http://devinmcafee.wordpress.com/?p=135', 0, 'post', '', 0),
(145, 1, '2013-05-21 20:06:46', '2013-05-21 20:06:46', 'I haven''t trained in almost two weeks, I recently graduated college and have been busy. Also, I wanted to rest my glute. I got an MRI taken of my lumbar spine a few days ago and will find out the results tomorrow. My doctor doubts that the pain I had in my glute is the sciatic nerve since it is very centralized to one area and does not run down my leg. I have been doing the pidgeon pose stretch several times a day and my glute has begun feeling better. This morning I woke up with only a twinge in my glute and decided I wanted to workout.\n\nSnatch: Bar, 65x3x1, 85x3x2, 115x3x1, 135x3x1, 155x2x1, 175x1, 185x2xF, 185x1\nClean and Jerk: 135x2x1, 155x1, 175x1, 185x1, 205x1, 225x3xF, 205x2xF\nPower Snatch + FS + Push Press: 135x1+2+1', 'Training 5/21/2013', '', 'publish', 'open', 'open', '', 'training-5212013', '', '', '2013-05-21 20:06:46', '2013-05-21 20:06:46', '', 0, 'http://devinmcafee.wordpress.com/?p=145', 0, 'post', '', 0),
(148, 1, '2013-05-23 17:56:29', '2013-05-23 17:56:29', '<p>My orthopedic surgeon told me that the MRI of my lumbar showed a herniation in the L4/L5 disc. This will not stop me from training, but I am going to have to be very conservative in my training and rehabilitation.</p><p> </p><p>Snatches: Bar, 65x3x1, 85x3x1, 95x3x1, 115x2x1, 135x3x1, 145x2x1, 155x2x1,165xF, 165x2x1, 175x3x1</p><p>Clean and Jerk: 135x3x1, 155x2x1, 175x2x1, 185x2x1, 205x2x1, 205xF</p><p>FS: 135x3, 185x2x2, 205x2x1, 225xF</p><p>Pullups: BWx52x5, BWx3, BWx3</p><p> </p><p>AI did some light stretching both before and after the workout , I am going to try and start doing McKenzie Pressups to try and rehab my spine</p>', 'Training 5/23/2013 & Injury Update', '', 'publish', 'open', 'open', '', 'training-5232013-injury-update', '', '', '2013-05-23 17:56:29', '2013-05-23 17:56:29', '', 0, 'http://devinmcafee.wordpress.com/?p=148', 0, 'post', '', 0),
(157, 1, '2013-05-25 21:59:51', '2013-05-25 21:59:51', '<p>Snatch: Bar, 65x3x1, 85x3x1, 95x3x1, 115x3x1, 135x2x1, 155x2x1, 175xF, 175x1, 185x1, 195x1 (PR)</p><p>Clean and Jerk: 135x1, 155x1, 175x1, 185x1, 205x2xF, 205x1, 225x3xF</p><p>FS: 225x3x1, 185x2x3</p>', 'Training 5/25/2013', '', 'publish', 'open', 'open', '', 'training-5252013', '', '', '2013-05-25 21:59:51', '2013-05-25 21:59:51', '', 0, 'http://devinmcafee.wordpress.com/?p=157', 0, 'post', '', 0),
(805, 1, '2014-10-31 02:06:36', '2014-10-31 02:06:36', 'Sn balance+ heaving Sn balance: 40, 50, 60x1+2, 70x1+2, 78x4x1+2\nStiff legged dl: 80x5, 88x5, 100x4x4\nOh plate situp+ Russian twist: 25x3x10+20\n\nFelt sharp, hungry to lift.', 'Dcw', '', 'inherit', 'closed', 'closed', '', '804-revision-v1', '', '', '2014-10-31 02:06:36', '2014-10-31 02:06:36', '', 804, 'http://www.devinmcafee.com/training/?p=805', 0, 'revision', '', 0),
(806, 1, '2014-11-01 17:26:10', '2014-11-01 17:26:10', 'Snatch: 62x2, 72x2, 82x2, 87x2x2 (<strong>PR double</strong>)\nClean and jerk: 69x3+1, 81x3+1, 92x1+f, 92x2+1, 92x2+1, 97x1+1, 97x1+1\nPause bs: 72x3, 76x3, 84x6x3', 'Dcw', '', 'publish', 'closed', 'closed', '', 'dcw-84', '', '', '2014-11-01 17:26:10', '2014-11-01 17:26:10', '', 0, 'http://www.devinmcafee.com/training/?p=806', 0, 'post', '', 0),
(171, 1, '2013-06-01 16:05:10', '2013-06-01 16:05:10', '<p>Today I began training with the DC Weightlifting Club. We are training in a mainly soviet style lifting program which was taken from Bob Takano''s book.</p><p><strong>Warmups: </strong>Bar work, Kelly Starrett super squat routine, etc</p><p><strong>Prep:</strong> Tall clean + Power Jerk: 40kgx2+1, 48x2+1, 56x2+1</p><p><strong>Work: </strong></p><p>Hang clean + Jerk: 60x2+1, 70x2+1, 80x3x2+1</p><p>FS: 60x3, 70x3, 75x3, 70x3</p>', 'Training 6/1/2013', '', 'publish', 'open', 'open', '', 'training-612013-2', '', '', '2013-06-01 16:05:10', '2013-06-01 16:05:10', '', 0, 'http://devinmcafee.wordpress.com/?p=171', 0, 'post', '', 0),
(810, 1, '2014-11-07 03:07:32', '2014-11-07 03:07:32', 'Clean: 60x2, 69x3, 80x3, 92x2x3, 97x1+F, 97x2 (<strong>Pr double</strong>)\nPull-ups: 10, 8, 7\nBtn push press+btn pwr jerk+btn push press: 60x2x1+1+1, 65x1+1+1\nStrict press: 65x3', 'Dcw', '', 'publish', 'closed', 'closed', '', 'dcw-86', '', '', '2014-11-07 03:07:32', '2014-11-07 03:07:32', '', 0, 'http://www.devinmcafee.com/training/?p=810', 0, 'post', '', 0),
(180, 1, '2013-06-02 16:04:31', '2013-06-02 16:04:31', '<p>Today Coach Mike had me do a lot of Snatch Deadlifts. He said that my hips were too low and I wasn''t actively sweeping the bar into my hips. This was definitely valid criticism and I''ve always noticed that the bar loops out on me. He used the cues "Flare and Sweep" to flare my knees out and sweep to sweep the bar in. Also, he taught me the scarecrow position to lead with my elbows. After teaching the scarecrow I could really feel the bar staying close to my body. I probably did ~20 reps of Snatch Deadlifts and Power Snatches with real light weight (65-85lbs).</p><p> </p><p>At the end I did OHS with 45kg, 52kg, 62.6x3, 1+F, 2</p><p>I was pretty beat up after this workout and my traps and upper back are particularly fatigued.</p>', 'Training 7/2/2013', '', 'publish', 'open', 'open', '', 'training-722013', '', '', '2013-06-02 16:04:31', '2013-06-02 16:04:31', '', 0, 'http://devinmcafee.wordpress.com/?p=180', 0, 'post', '', 0),
(192, 1, '2013-06-07 02:23:27', '2013-06-07 02:23:27', '<p>I  forgot to log my training yesterday but we did high pulls,  snatch singles up to 75kg  and then bs triples up to 185 lbs.</p><p> </p><p> Today:</p><p style="display:inline !important;"> </p><p style="display:inline !important;"> Tall clean+power jerk: 50kgx2+2, 50x2+2</p><p> clean+ jerk: 60x2+2, 60x2+2, 70x1+1, 75x1+1,70x1+1</p><p> front squat: 60x3,70x3, 80x3,70x3</p><p> Russian twist:25x3x20</p><p> pushups:18+7+5 (30  total in 2  minutes)</p>', ' Training 6/5 + 6/6/2013', '', 'publish', 'open', 'open', '', 'training-65-662013', '', '', '2013-06-07 02:23:27', '2013-06-07 02:23:27', '', 0, 'http://devinmcafee.wordpress.com/?p=192', 0, 'post', '', 0),
(204, 1, '2013-06-07 02:24:25', '2013-06-07 02:24:25', '', '20130605_191250', '', 'inherit', 'open', 'open', '', '20130605_191250', '', '', '2013-06-07 02:24:25', '2013-06-07 02:24:25', '', 0, 'http://www.devinmcafee.com/training/wp-content/uploads/2013/06/20130605_191250.jpg', 0, 'attachment', 'image/jpeg', 0),
(206, 1, '2013-06-08 14:47:36', '2013-06-08 14:47:36', '<strong>Prep:</strong> \n2 Tall clean+ power jerk+ jerk: 20kg, 30kg, 40kg, 50kg\n\n<strong>Work:</strong>\nClean + jerk: 60kgx2x2+1, 70x2+1, 75x1+1, 80x1+1, 85x1+1\n\nStrength:\nClean extensions from deficit: 85x3x3\n\n<strong>Assistance:</strong>\nHigh box step ups: 50x3x5/5', 'Training 6/8/2013', '', 'publish', 'open', 'open', '', 'training-682013', '', '', '2013-06-08 14:47:36', '2013-06-08 14:47:36', '', 0, 'https://devinmcafee.wordpress.com/?p=206', 0, 'post', '', 0),
(208, 1, '2013-06-09 14:30:17', '2013-06-09 14:30:17', '<strong>Warm-up:</strong>\nBar work, Kelly Starret''s super squat mobility, pidgeon pose, knee banded bw squats\n\n<strong>Prep:</strong>\nSn ext(3 pause)+2 hang sn hi pull+2 power sn: 65lbsx3x1, 85lbsx2x1\n\n<strong>Work:</strong>\nSn high pull+ power snatch: 115lbsx2+2, 135x2+2, 145x1+1, 155x1+1\n\nSots press: 65lbsx3x3, 75x3\n\nBar roll outs+ side bends(95lbs, 45lbs db): (5+7/side)x3\n\nBack squats: 95lbsx3, 145x3, 185x3, 215x3, 185x3\n\n<strong>Cool down:</strong>\nHamstring stretches with green band\n\nEverything felt good today. My glute has been bothering me significantly less recently.', 'Training 6/9/2013', '', 'publish', 'open', 'open', '', 'training-692013', '', '', '2013-06-09 14:30:17', '2013-06-09 14:30:17', '', 0, 'https://devinmcafee.wordpress.com/?p=208', 0, 'post', '', 0),
(210, 1, '2013-06-13 02:34:50', '2013-06-13 02:34:50', '<strong>Prep:</strong>\nPause snatch ext x2\nHi hang snatch pull x2\nTall clean x2\n\n<strong>Work:</strong>\nSnatch: 95x2x2, 115x2x2, 140x2, 160x1, 170x1x2, 180x1\n\nSnatch hi pull: 180x2x2\n\nBs: 135x5, 175x2x5, 195x2x5, 215x4+f\n\n<strong>Assistance:</strong>\n\nAb roller+ push up (no rest between sets or exercises): 8+10, 5+8, 5+5', 'Training 6/12/13', '', 'publish', 'open', 'open', '', 'training-61213', '', '', '2013-06-13 02:34:50', '2013-06-13 02:34:50', '', 0, 'https://devinmcafee.wordpress.com/?p=210', 0, 'post', '', 0),
(212, 1, '2013-06-14 03:14:59', '2013-06-14 03:14:59', '<p><strong>Prep:</strong></p><p>Hang Hi-Pull x2 + Power Jerk + Split Jerk</p><p><strong>Work:</strong></p><p><strong></strong>Hang Clean + Pwr Jerk + Split Jerk: 95lbs, 135lbs, 145, 165</p><p>Jerk: 165x3x2, 135x4x2</p><p>FS: 135x3, 165x3, 185x3</p><p> </p><p>Worked on my jerks today, although that was not the original plan. Coach focused on my front knee, reaching instead of pushing with it. My front knee angle is supposed to be less than 90 degrees and I need to be balanced over my hips.</p>', 'Training 6/13/2013', '', 'publish', 'open', 'open', '', 'training-6132013', '', '', '2013-06-14 03:14:59', '2013-06-14 03:14:59', '', 0, 'http://devinmcafee.wordpress.com/?p=212', 0, 'post', '', 0),
(218, 1, '2013-06-16 19:09:50', '2013-06-16 19:09:50', '<strong>Prep:</strong>\nHang snatch hi pull x2\nHang power snatch x2\nSnatch balance:\n65lbs, 65, 85\n\n<strong>Work:</strong>\nHang snatch: 100x3, 115x3, 135x2, 145x3x2\n\nBack squat: 145x5, 175x5, 195x5, 215x3x2\n\nI was supposed to do two sets of 5 of 215, but I have been sleeping poorly and eating poorly the past two days and did not have the strength to dig deep. The doubles were a struggle by themselves and I don''t know if I would have been able to do a triple', 'Training 6/16/2013', '', 'publish', 'open', 'open', '', 'training-6162013', '', '', '2013-06-16 19:09:50', '2013-06-16 19:09:50', '', 0, 'https://devinmcafee.wordpress.com/?p=218', 0, 'post', '', 0),
(220, 1, '2013-06-20 03:41:30', '2013-06-20 03:41:30', '<p><strong>Prep:</strong></p><p>4x2 Pause snatch Ext + 2 tall clean: 65,65,85</p><p><strong>Work:</strong></p><p><strong></strong>Snatch: 95x2, 120x1, 140x1, 150x1, 160x1, 170x1, 180x1, 180xF, 180x1, 150x3x1</p><p>Snatch Grip High Pull From Ground: 150x3, 150x3, 150x3</p><p>FS: 155x3, 175x3, 195x3</p>', 'Training 6/19/2013', '', 'publish', 'open', 'open', '', 'training-6192013', '', '', '2013-06-20 03:41:30', '2013-06-20 03:41:30', '', 0, 'http://devinmcafee.wordpress.com/?p=220', 0, 'post', '', 0),
(225, 1, '2013-06-21 03:19:52', '2013-06-21 03:19:52', '<strong>Prep</strong>\n2 clean high pull\n2 power clean\nOff side jerk\nJerk:\n65lbs, 85, 105\n\n<strong>Work</strong>\nPower clean+c&amp;j:\n115, 135, 160, 160, 175\n\nFS: 145x5, 155x5, 165x2x3, 175x3, 185x3', 'Training 6/20/13', '', 'publish', 'open', 'open', '', 'training-62013', '', '', '2013-06-21 03:19:52', '2013-06-21 03:19:52', '', 0, 'https://devinmcafee.wordpress.com/?p=225', 0, 'post', '', 0),
(227, 1, '2013-06-22 15:53:07', '2013-06-22 15:53:07', '<p><strong>Prep:</strong></p><p>3-Pause Sn Grip High Pull: 65lbsx3</p><p>High Hang Sn Grip High Pull: 85x3</p><p>Power Snatch: 85x3</p><p>Tall Snatch: 85x3</p><p><strong>Work:</strong></p><p>Sn: 105x2, 120x3, 130x3, 140x3, 150x1+F+1, 150x2, 160xF+1, 160x2</p><p>Sn Grip BTN Push Press: 100x3, 120x2x3, 140x2x3</p><p>Back Squat: 140x3, 185x2x3, 215xF (Leaned forward too much and ended up falling on my knees)<br /><br />My calves started acting up, I think this contributed to me missing on an easy 215 back squat. I iced them after practice.</p>', 'Training 6/22/2013', '', 'publish', 'open', 'open', '', 'training-6222013', '', '', '2013-06-22 15:53:07', '2013-06-22 15:53:07', '', 0, 'http://devinmcafee.wordpress.com/?p=227', 0, 'post', '', 0),
(238, 1, '2013-06-23 18:33:15', '2013-06-23 18:33:15', '<strong>Prep:</strong>\n3-pause clean extension\n+Clean high pull\n+Tall clean\n\n<strong>Work:</strong>\nClean: 115x3, 140x3, 165x3, 175x2x3\nDeficit clean dl: 180x4x4\nStrict press: 130x4x3\nGood morning: 130x4x6', 'Training 6/23/2013', '', 'publish', 'open', 'open', '', 'training-6232013', '', '', '2013-06-23 18:33:15', '2013-06-23 18:33:15', '', 0, 'https://devinmcafee.wordpress.com/?p=238', 0, 'post', '', 0),
(240, 1, '2013-06-27 03:33:34', '2013-06-27 03:33:34', '<p>Prep: Bar work</p><p><strong>Work</strong>:</p><p>BTN Jerk: 40kgx3, 45x3, 50x3, 75x3, 75x3, 80x2, 80x1+F, 80x2</p><p>BS: 72x4, 85x2x4, 95x2x4</p><p>Push Jerk: 80x4, 80x4</p><p>Push Press: 70x4, 70x4</p><p> </p><p><a href="http://www.devinmcafee.com/training/wp-content/uploads/2013/06/2013-06-23-21-52-17.jpg"><img class="size-full wp-image" id="i-245" alt="Image" src="http://www.devinmcafee.com/training/wp-content/uploads/2013/06/2013-06-23-21-52-17.jpg?w=650" /><br /></a>Homemade Barbeque Pork chops and red beans and rice. A sample of this week''s meals.</p>', 'Training 6/26/2013', '', 'publish', 'open', 'open', '', 'training-6262013', '', '', '2013-06-27 03:33:34', '2013-06-27 03:33:34', '', 0, 'http://devinmcafee.wordpress.com/?p=240', 0, 'post', '', 0),
(245, 1, '2013-06-27 03:31:09', '2013-06-27 03:31:09', '', '2013-06-23 21.52.17', '', 'inherit', 'open', 'open', '', '2013-06-23-21-52-17', '', '', '2013-06-27 03:31:09', '2013-06-27 03:31:09', '', 0, 'http://www.devinmcafee.com/training/wp-content/uploads/2013/06/2013-06-23-21-52-17.jpg', 0, 'attachment', 'image/jpeg', 0),
(250, 1, '2013-06-28 03:19:35', '2013-06-28 03:19:35', '<strong>Prep:</strong> \n3 x 2 Hang Snatch Hi-Pulls + 1 Hang Power Snatch + 1 Heaving Snatch Balance\n\n<strong>Work:</strong>\nHang Power Snatch: 1x3@95lbs, 1x3@120, 1x3@130, 2x2@140\n\nOHS: 1x3@115, 2x3@135, 2x3@145\n\nSnatch DL w/ Two Pauses (1st below the knee, 2nd above the knee): 2x3@175lbs, 2x3@205lbs', 'Training 6/27/2013', '', 'publish', 'open', 'open', '', 'training-6272013', '', '', '2013-06-28 03:19:35', '2013-06-28 03:19:35', '', 0, 'https://devinmcafee.wordpress.com/?p=250', 0, 'post', '', 0),
(252, 1, '2013-07-04 03:43:00', '2013-07-04 03:43:00', 'Prep: \n2 high hang pull+2 hang power snatch+2 snatch balance:\n65lbs, 85, 105\n\nWork:\nSnatch from blocks: 105x3, 125x3, 135x3, 145x3, 155x3\nHigh pull from ground: 165x4x3\nBs: 160x3, 185x2x3, 205x5, 225x3\n\nI was supposed to only do 205x3 (80%x3) but it felt light. I then decided to go and do 225x3 (my new 80%). I felt fresh and fast due to spending the weekend at the beach and skiing the weekend workouts. This was my first training session with my new shoes.', 'Training 7/3/13', '', 'publish', 'open', 'open', '', 'training-7313', '', '', '2013-07-04 03:43:00', '2013-07-04 03:43:00', '', 0, 'https://devinmcafee.wordpress.com/?p=252', 0, 'post', '', 0),
(254, 1, '2013-07-06 15:11:04', '2013-07-06 15:11:04', '<p><strong>Prep:</strong> </p><p>Hi hang snatch pull x2</p><p>+ hi hang power snatch x2</p><p>+ snatch balance x2</p><p>+ tall snatch x2</p><p>30kg, 40kg</p><p> </p><p><strong>Work:</strong></p><p><strong></strong>Snatch: 45x3, 55x3, 60x2, 70x2, 80xF+F (front), 80xF (behind)</p><p>C&amp;J: 60kgx3+2, 70x3+2, 75x2+1, 80x2x2+1</p><p>BS: 60x5, 85x5, 90x3, 105x2x2, 90x2x3</p><p> </p><p>I keep smashing my pubic bone and started missing snatches infront. The C&amp;J I felt fast.</p>', 'Training 7/6/2013', '', 'publish', 'open', 'open', '', 'training-762013', '', '', '2013-07-06 15:11:04', '2013-07-06 15:11:04', '', 0, 'http://devinmcafee.wordpress.com/?p=254', 0, 'post', '', 0),
(265, 1, '2013-07-07 14:13:15', '2013-07-07 14:13:15', 'Prep:\n3 pos. Clean ext x2\n+ high hang high pull x2\n+ hang power clean\n65lbs, 85lbs\n\nWork:\nPower clean: 115x2, 135x2, 145x2, 165x2x2\nClean dl: 185x3, 195x3, 205x2, 215x2x2\nGood mornings: 145x3x3\nFront squat: 145x3, 165x3, 185x3, 205x3, 225x1+F, 225x2, 235x1', 'Training 7/7/2013', '', 'publish', 'open', 'open', '', 'training-772013', '', '', '2013-07-07 14:13:15', '2013-07-07 14:13:15', '', 0, 'https://devinmcafee.wordpress.com/?p=265', 0, 'post', '', 0),
(267, 1, '2013-07-11 03:28:25', '2013-07-11 03:28:25', 'Prep:\nHang high pull x2\n+ hang power clean x2\n+ power jerk\n+ split jerk\n\n<strong>Work:</strong>\nHang clean: 60kgx2, 70kgx2, 80x2x2, 90x2\nJerks: 60x2, 70x2, 80x3x2, 90, 100\nFs: 60x3, 70x3, 100x2, 90x2, 80x3\nJerk: 95, 80\n\nThe 100kg jerk felt easy. My 1rm has definitely gone up', 'Training 7/10/2013', '', 'publish', 'open', 'open', '', 'training-7102013', '', '', '2013-07-11 03:28:25', '2013-07-11 03:28:25', '', 0, 'https://devinmcafee.wordpress.com/?p=267', 0, 'post', '', 0),
(269, 1, '2013-07-12 02:59:39', '2013-07-12 02:59:39', '<strong>Prep:</strong> high pull x3\n+ hang power snatch x2\n+ btn snatch push press x2\n+ snatch balance\n\n<strong>Work:</strong>\nHang power snatch: 125lbsx2x3, 135x3, 145x2x2\n\nOhs: 125x4, 135x4, 145x3, 155x2x3\n\nSnatch dead lift: 155x3, 165x3x3\n\nAlternating Pull ups: 5, 3, 3, 3, 3, 5, 5, 3', 'Training 7/11/13', '', 'publish', 'open', 'open', '', 'training-71113', '', '', '2013-07-12 02:59:39', '2013-07-12 02:59:39', '', 0, 'https://devinmcafee.wordpress.com/?p=269', 0, 'post', '', 0),
(271, 1, '2013-07-13 16:18:13', '2013-07-13 16:18:13', '<strong>Work:</strong>\nClean and jerk: \n60kgx2+1, 70x2+1, 75x2+1, 80x2+1, 90x1+F, 80x2+1, 90x2+1\n\nClean ext: 90x4x3\n\nStrict press: 60x2x4\n\nI tweaked my neck on the strict presses. Ibuprofen, ice pack, rest. Hopefully this is short lived', 'Training 7/13/2013', '', 'publish', 'open', 'open', '', 'training-7132013', '', '', '2013-07-13 16:18:13', '2013-07-13 16:18:13', '', 0, 'https://devinmcafee.wordpress.com/?p=271', 0, 'post', '', 0),
(273, 1, '2013-07-18 03:28:38', '2013-07-18 03:28:38', '<p><strong>Warm up: <br /></strong></p><p>Lacrosse ball on my upper right trap near my spine (this is where my neck injury is). I believe the injury stemmed from trying to actively push my head through the overhead press on Saturday. Also my usual routine of kelly starret''s super squat mobility routine, pvc shoulder dislocations, knee band squats, and bar work</p><p><strong><br />Prep: </strong></p><p>High hang Sn High Pull x3</p><p>Hang Pwr Sn x2</p><p>Sn Balance</p><p> </p><p><strong>Work:</strong></p><p>Hang Pwr Sn + OHS: 105lbsx1+3,125x1+3, 145x1+3, 155x3x1+3</p><p>Back Squat: 160x3, 185x3, 215x3, 230x2x2 (PR Double)</p><p>Good morning: 135x2x7</p><p> </p>', 'Training 7/17/2013', '', 'publish', 'open', 'open', '', 'training-7172013', '', '', '2013-07-18 03:28:38', '2013-07-18 03:28:38', '', 0, 'http://devinmcafee.wordpress.com/?p=273', 0, 'post', '', 0),
(281, 1, '2013-07-19 02:51:16', '2013-07-19 02:51:16', '<p><strong>Prep</strong>:</p><p>OHPx6, Pwr Jerkx3, Jerk, Tall Clean x2:</p><p>Bar, 40kg, 60kg</p><p><strong>Work:</strong></p><p>Pwr Clean: 50kgx3, 60x3, 70x3x3</p><p>Rack Pwr Jerk: 50x3, 60x3, 70x2x3, 65x3</p><p>FS:  64x3, 77x3, 90x3, 100x2x2, 80x3</p><p>Rack Jerk: 80kg</p><p>My neck is healing up nicely, I felt a little tenderness during today''s workout but not enough to hold me back.</p><p> </p>', 'Training 7/18/2013', '', 'publish', 'open', 'open', '', 'training-7182013', '', '', '2013-07-19 02:51:16', '2013-07-19 02:51:16', '', 0, 'http://devinmcafee.wordpress.com/?p=281', 0, 'post', '', 0),
(291, 1, '2013-07-21 15:05:28', '2013-07-21 15:05:28', '<p><strong>Prep</strong>: Pause Clean Ext x3, High Pull x2, Tall Clean x3<br /><strong>Work:</strong></p><p><strong></strong>Clean: 60kgx2, 70x2, 80x2x2, 90x2x1, 80x2</p><p>Pwr Sn + OHP: 40x3+3, 50x2+2, 57x2+2, 60x2+2</p><p>Sn: 65x2x2, 6x1+f+1</p><p> </p><p>My neck was nagging me slightly today, no pain but it feels tight and I am definitely aware of it.</p>', 'Training 7/21/2013', '', 'publish', 'open', 'open', '', 'training-7212013', '', '', '2013-07-21 15:05:28', '2013-07-21 15:05:28', '', 0, 'http://devinmcafee.wordpress.com/?p=291', 0, 'post', '', 0),
(295, 1, '2013-07-25 03:36:53', '2013-07-25 03:36:53', '<strong>Prep:</strong> clean extension, high hang pull, hang power clean\n\n<strong>Work:</strong>\nHang power clean: 50kgx3, 60x3, 70x2x3\n\nClean high pull: 80x4x2\n\nFs: 66x5, 77x5, 90x3, 95x2, 110x1, 110x2xF\n\nClean: 90x1\n\nFs: 90x3', 'Training 7/24/13', '', 'publish', 'open', 'open', '', 'training-72413', '', '', '2013-07-25 03:36:53', '2013-07-25 03:36:53', '', 0, 'https://devinmcafee.wordpress.com/?p=295', 0, 'post', '', 0),
(297, 1, '2013-07-26 02:30:29', '2013-07-26 02:30:29', '<strong>Prep:</strong>\n3 x pause sn ext\n2 x hang high pull\n1 x tall sn\n\n<strong>Work:</strong>\nPwr Sn: 52kgx2, 62x2\nSn: 66x2, 70x2, 76x2, 80x3x1\nSn off blocks(2 45s): 70x3x2\n\n<strong>Core:</strong>\nWall bounce Medicine ball sit ups: 2x25', 'Training 7/25/2013', '', 'publish', 'open', 'open', '', 'training-7252013', '', '', '2013-07-26 02:30:29', '2013-07-26 02:30:29', '', 0, 'https://devinmcafee.wordpress.com/?p=297', 0, 'post', '', 0),
(299, 1, '2013-07-28 11:51:04', '2013-07-28 11:51:04', 'Work: \nClean + jerk: 135lbsx2+1, 155x2+1, 175x2+1, 195x1+1, 205x1+1\n\nFs: 155x3\n\nOhp: 135x3, 135x2+f\nCurls: 75x2x8\nIncline bench: 135x8\nChest supported t bar row: 45x8, 90x6', 'Training 7/27/2013', '', 'publish', 'open', 'open', '', 'training-7272013', '', '', '2013-07-28 11:51:04', '2013-07-28 11:51:04', '', 0, 'https://devinmcafee.wordpress.com/?p=299', 0, 'post', '', 0),
(301, 1, '2013-08-11 17:09:48', '2013-08-11 17:09:48', '<p>On July 31st, I reinjured my back. I was doing back squats, and did 1 set of 235x2. On my second set, I got the first rep, but was focusing on getting full depth as some of my teammates were stopping short of full depth. I came forward and instead of dumping the bar or failing, I fought. I ended up standing up with the second rep, but I felt a snip in my lower back (near my tailbone) and then a wave of heat go down my right leg all the way down to my calf. I knew I had just reinjured my back, and immediately stopped what I was doing.<br /><br />The next morning I could not stand up, if I put any weight on my right leg I would get extreme sciatic pain. I started taking a Medrol 6 pack to cut down the inflammation the next day. After 24 hours I was able to walk around again and I began to become mobile again.<br /><br />Fast forward a week or so of hobbling, and here I am starting to work out again.<br /><br />Rehab Day 1:</p><p>Stretching (Kelly Starrett, Pidgeon pose, etc)</p><p>Front squats: bar, 65lbsx6, 75x6, 95lbsx2x6</p><p>OHP: Bar, 65x8, 75x8, 95x2x8</p><p>Pull ups: BWx18x1</p><p>Ez Bar Curls: 50x3x15</p><p>Rear delt Machine Row: 50x3x12</p><p> </p><p>No sciatic pain during the workout, only tomorrow will tell. I have a PT appointment tomorrow at 3:45</p>', 'Back Reinjury and Rehab', '', 'publish', 'open', 'open', '', 'back-reinjury-and-rehab', '', '', '2013-08-11 17:09:48', '2013-08-11 17:09:48', '', 0, 'http://devinmcafee.wordpress.com/?p=301', 0, 'post', '', 0),
(310, 1, '2013-08-22 01:26:56', '2013-08-22 01:26:56', '<p>Warm up: Band assisted hamstring stretches, leg only bird dogs</p><p>FS: Barx15, 55x3x15</p><p>OHP: Barx15, 55x3x15</p><p>Rear Delt Machine: 90x3x15</p><p>Ez Bar Curl: 70x6, 60x2x10</p><p>Seated Tricep Pushdown Machine: 90x15, 105x2x15</p><p>Cool down: Leg only bird dog, band assisted hamstring stretches (these felt good), cat/camels</p><p> </p><p>It feels good to be moving again. I am going to use this time away from heavy lifting to focus on core work and hypertrophy. No sciatic pain of late and I can touch my toes without pain.</p><p> </p><p>Currently eating quite a bit, and taking the following supplements for recovery:<br />5 fish oil capsules, multivitamin, extra strength glucosamine, and 1-2 magnesium pills every other night or so.</p>', 'Rehab 8/21/2013', '', 'publish', 'open', 'open', '', 'rehab-8212013', '', '', '2013-08-22 01:26:56', '2013-08-22 01:26:56', '', 0, 'http://devinmcafee.wordpress.com/?p=310', 0, 'post', '', 0),
(319, 1, '2013-09-01 20:10:50', '2013-09-01 20:10:50', '<p>So I have been training pretty frequently, working my way up gradually adding 5 lbs to the bar each time with a focus on training my core. I don''t think the recent numbers are really that important so I haven''t been logging them. However, my usual routine looks like this</p><p><br />FS 3x15, OHP 3x15 (Same weight as FS), Pullups ~20 with different set/rep schemes, Accesory arm work, Planks, bird dogs, hamstring stretching etc</p><p> </p><p>Today:</p><p>Cat camels, Band assisted Hamstring stretching, kelly starrett''s hip mobility, leg only bird dog, hip flexor stretch</p><p>OHS: Barx5</p><p>FS: 75x3x15</p><p>OHP: 75x3x15</p><p>Snatch: 75x2x2+OHS (post injury PR)</p><p>C&amp;J: 75x2x1 (post injury PR)</p><p>Pullups: BWx8x3</p><p>Incline Bench: 135x8, 135x8, 135x6</p><p>Ez Bar Curl: 70x12</p><p>Plank: 2x120 count</p><p>Side plank: 60 count/side</p><p>Hamstring stretching, then 10 minutes in the sauna</p><p> </p><p>I do not feel sciatic pain, but I do feel pain in my lower back sometimes. Especially after standing up after sitting early in the morning.</p>', 'Rehab 9/1/2013', '', 'publish', 'open', 'open', '', 'rehab-912013', '', '', '2013-09-01 20:10:50', '2013-09-01 20:10:50', '', 0, 'http://devinmcafee.wordpress.com/?p=319', 0, 'post', '', 0),
(331, 1, '2013-09-06 23:05:47', '2013-09-06 23:05:47', 'Rehab is coming along nicely. I have less and less discomfort each day.\n\nToday:\nFs: 80x3x15\nOhp: 80x15, 80x2x12\nSnatch pull: 80x3\nSnatch: 80x3x3\nC&amp;j: 80x3x3\nLat pulldown: #11x3x10\nIncline bench: 135x3x8\nRear delt row machine: 90x3x5\nUni Side db raise: 25x6, 20x2x8\nPlank: 150ct, 80ct/side, 150ct', 'Training 9/5/2013', '', 'publish', 'open', 'open', '', 'training-952013', '', '', '2013-09-06 23:05:47', '2013-09-06 23:05:47', '', 0, 'https://devinmcafee.wordpress.com/?p=331', 0, 'post', '', 0),
(333, 1, '2013-10-11 02:37:13', '2013-10-11 02:37:13', 'I''ve been working out about 2-3 times a week. Every week looks something like this:\n\nGlute ham raise\nSquat variation\nOlympic lift\nPull ups\nAuxiliary work (curls, high pulls, ohp)\nPlanks (3 sets for a minute and a half or more)\nHamstring stretches\n\nI jerked 195# easily Tuesday and snatched 145# today.\n\nI worked my front squat up to 135# by adding 5 lbs to the bar every new day I squatted. I am now easing my way into back squats and focusing on form.\n\nCurrent cues:\nUpright, engaged core, flexed glutes, weight on my heels.\n\nI think if I continue hammering form for another month or so I may be ready to resume regular back squats. I have to relearn the movement however to prevent reinjuring myself.\n\nHere''s to the ''14 Baltimore open', 'Steady rehab', '', 'publish', 'open', 'open', '', 'steady-rehab', '', '', '2013-10-11 02:37:13', '2013-10-11 02:37:13', '', 0, 'https://devinmcafee.wordpress.com/?p=333', 0, 'post', '', 0);
